(1, 1, 'Leiden Centraal - Schiphol ', 'Marktvraag corridor als in SprintStad v1.1', -912, -1965, 1),
(2, 1, 'Den Haag CS - Rotterdam CS', 'Marktvraag corridor als in SprintStad v1.1', -588, -2450, 1),
(3, 1, 'Den Haag - Rotterdam alles 1ha', 'alle typen 1ha', -588, -2450, 1),
(4, 1, 'Den Haag - Rotterdam jan2012', 'finetuning tbv sessie Utrecht', -588, -2450, 1),
(5, 1, 'Utrecht - Rhenen: compact progressief', 'Compact en progressief\r\nSturing op (hoog)stedelijke woonmilieu''s rond knooppunten.\r\nBeperkte vraag naar landelijk en dorps wonen rond stations.\r\nFrequentieverhoging en onderliggend OV moeten goed meegroeien (Uithoftram vanuit Zeist en Utrecht, visgraat bij Maarn).\r\nCrisis tot 2014, daarna herstel.\r\n\r\nontwikkelruimte 601 ha\r\nprogramma 635 ha', -1850, -2500, 0.7),
(6, 1, 'Utrecht - Rhenen: liberaal suburbaan', 'Liberaal Suburbaan:\r\nBeperkte sturing op hoge dichtheden rond knooppunten. Voldoende vraag naar lage dichtheden op de markt. Investeringen in asfalt. Kan in deze context toch TOD plaatsvinden, met frequentieverhoging op de lijn?\r\nCrisis tot 2014, daarna herstel.\r\n\r\nontwikkelruimte 601 ha\r\nprogramma 690 ha', -1850, -2500, 0.7),
(7, 1, 'Utrecht - Rhenen - Ede: compact progressief', 'Compact en progressief\r\nSturing op (hoog)stedelijke woonmilieu''s rond knooppunten.\r\nBeperkte vraag naar landelijk en dorps wonen rond stations.\r\nFrequentieverhoging en onderliggend OV moeten goed meegroeien (Uithoftram vanuit Zeist en Utrecht, visgraat bij Maarn).\r\nCrisis tot 2018, daarna herstel.\r\n\r\nOntwikkelruimte: 860 ha\r\nProgramma: 860 ha ', -1925, -2500, 0.6),
(8, 9, 'Zaancorridor - marktconform', 'Woonmilieus regio''s Alkmaar, Zaanstad en 20% Amsterdam.\r\nVerloop van Hoogstedelijk tot Dorps meetelling in marktvraag Zaancorridor.\r\nVoorzieningen = 50% bovenop betreffende woonmilieu.\r\nKantorenprogramma uit Monitor, uitgebreid met transformatieopgave Sloterdijk.\r\nBedrijventerreinen inschatting.\r\n\r\nmarktvraag (ha) = ontwikkelruimte', -1100, -1300, 0.8),
(9, 9, 'TFR_test1', 'xxx', -1000, -1550, 0.8),
(10, 17, 'Zuid-Kennemerland: Business-as-usual', 'Overlap HOV: door hogere frequentie trekt hov de reizigers uit de trein.\r\nWonen = 90% van gehele marktvraag (Companen) in Zuid-Kennemerland, evenredig verdeeld over de milieus.\r\nGemengde milieus 33% voorziengen, overige milieus 13%.\r\nKantoren op basis van Plabeka en methode courante leegstand Maak Plaats!\r\nBedrijven op basis van Plabeka en inschatting herstructureringsgebieden.\r\nMarktvraag = 927 ha.\r\nBeschikbare ontwikkelruimte = de bestaande plancapaciteit = 209 ha', -900, -1500, 1.1),
(11, 17, 'Zuid-Kennemerland: maximaal TOD', 'Overlap HOV: door hogere frequentie trekt hov de reizigers uit de trein.\r\nWonen = 90% van gehele marktvraag (Companen) in Zuid-Kennemerland, evenredig verdeeld over de milieus.\r\nGemengde milieus 33% voorziengen, overige milieus 13%.\r\nKantoren op basis van Plabeka en methode courante leegstand Maak Plaats!\r\nBedrijven op basis van Plabeka en inschatting herstructureringsgebieden.\r\nMarktvraag = 927 ha.\r\nBeschikbare ontwikkelruimte = de bestaande plancapaciteit + extra ontwikkelruimte op basis van grondgebruik = 927 ha', -900, -1500, 1.1);
