INSERT INTO `station` (`id`, `code`, `name`, `variant`, `description_facts`, `description_background`, `description_future`, `town`, `region`, `POVN`, `PWN`, `IWD`, `MNG`, `area_cultivated_home`, `area_cultivated_work`, `area_cultivated_mixed`, `area_undeveloped_urban`, `area_undeveloped_rural`, `transform_area_cultivated_home`, `transform_area_cultivated_work`, `transform_area_cultivated_mixed`, `transform_area_undeveloped_urban`, `transform_area_undeveloped_rural`, `count_home_total`, `count_home_transform`, `count_work_total`, `count_work_transform`, `count_worker_total`, `count_worker_transform`) VALUES
(1, 'Sas', 'Sassenheim', '1', '', 'In de directe omgeving van het station Sassenheim ligt het Groene Hart. De OV-bereikbaarheid is laag maar de autobereikbaarheid is hoog. De inwoners- en werknemersdichtheid is gemiddeld en er is in de huidige situatie sprake van functiemenging door de aanwezige bedrijventerreinen.[n][n]De ontwikkelruimte in de toekomst bestaat deels uit transformatie en deels uit verstedelijking van onbebouwd gebied. De transformatiegebieden bevatten een deel herstructurering van het centrum van Sassenheim en herontwikkeling van industrie- en bedrijventerreinen langs het spoor en de A44.[n][n]Het geplande station vormt tevens een verbinding tussen Sassenheim en de nieuw te ontwikkelen poldergebieden ten zuiden van de infrastructuur.', 'In 2010 bestaat dit station nog niet. Er vertrekken in de buurt van de locatie 4 streekbussen per uur verdeelt over 2 richtingen. HSL, Intercity''s, sneltreinen, lightrail en trams stoppen niet op dit station.[n][n]In de periode 2010-2014 wordt het station Sassenheim in gebruik genomen.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Teylingen', 'Holland Rijnland', 33, 185, 28, 34, 73, 35, 4, 91, 248, 4, 34, 1, 2, 27, 4024, 940, 78850, 43150, 3154, 1726),
(2, 'Ledn', 'Leiden Centraal', '1', '', 'De omgeving van het station kenmerkt zich door hoge inwoner- en werknemerdichtheid en een groot aantal inwoners, nabijheid van een universiteitscampus, een universitair medisch centrum en de historische binnenstad. Vrijwel alle ontwikkelruimte in de toekomst bestaat uit transformatie van bestaand stedelijk gebied.[n][n]In het kader van project Leiden Centraal zijn reeds tunnels, een busstation, een ondergrondse fietsenstalling, een appartementencomplex en kantoorruimte gerealiseerd. Het Stationsplein en de Stationsweg zijn opnieuw aangelegd. Momenteel zijn nog kantoren en woningen aan het Stationsplein in ontwikkeling, naast een multiplex bioscoop en een ROC.[n][n]In het kader van kenniscluster BioScience Park wordt de campuswijk aan de Zeezijde van het station herontwikkeld. In dit gebied bevinden zich o.a. het Leids Universitair Medisch Centrum, een bedrijvenpark, onderzoekcentra en Naturalis. De verkeerstructuur en openbare ruimte wordt aangepast.', 'In 2010 vertrekken op dit station per uur 18 Intercity''s en sneltreinen verdeelt over 11 richtingen, 8 Sprinters verdeelt over 4 richtingen en 2 Lightrail''s in 1 richting. Er vertrekken per uur 50 streekbussen in 25 verschillende richtingen. HSL en trams stoppen niet op dit station.[n][n]Er zijn plannen om tussen 2014 en 2018 de RijnGouwelijn op te leveren, de lightrailverbinding tussen Gouda over Alphen aan de Rijn en Leiden tot Katwijk of Noordwijk, met een frequentie van 4 per uur.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Intercity''s en 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Leiden', 'Holland Rijnland', 181, 120, 140, 88, 202, 47, 60, 59, 84, 60, 7, 19, 7, 24, 14567, 4860, 738300, 344900, 29532, 13796),
(3, 'Shl', 'Schiphol', '1', '', 'Het station Schiphol heeft ten opzichte van de andere stations de hoogste autobereikbaarheid en OV-bereikbaarheid. De omgeving van het station bezit het hoogste aantal werknemers, op enkele boerderijen na geen inwoners, en het laagste aantal hectares mogelijke ontwikkelruimte.[n][n]De ontwikkelingen van en rond Schiphol zijn economisch wenselijk en zorgen voor werkgelegenheid in de regio. Aan de andere kant zorgt een groter Schiphol voor meer overlast. Met betrekking tot de uitbreiding van de luchthaven zijn daarom tot 2020 afspraken gemaakt voor beheerste groei.[n][n]De totale ontwikkelruimte in dit stationsgebied bevindt zich in buitenstedelijk open gebied, ingesloten door infrastructuur.', 'In 2010 vertrekken op dit station per uur 22 Intercity''s verdeelt over 12 verschillende richtingen en 10 Sprinters verdeelt over 5 richtingen. De HOV-bus (Zuidtangent) rijdt op metrofrequentie richting Haarlem en Amsterdam-Zuid. Er vertrekken per uur 50 streekbussen verdeelt over 25 verschillende richtingen. Er is 2 keer per uur een HSL-verbinding met Amsterdam Centraal en Rotterdam-Brussel. Lightrail en trams stoppen niet op dit station.[n][n]In de periode 2014-2018 bouwt luchthaven Schiphol ten noorden van de landingsbanen een 2de terminal.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Haarlemmermeer', 'Stadsregio Amsterdam', 365, 235, 42, 0, 0, 21, 27, 316, 86, 0, 1, 4, 13, 1, 0, 0, 476950, 3850, 19078, 154),
(4, 'Hfd', 'Hoofddorp', '1', '', 'De omgeving van het station Hoofddorp kenmerkt zich ten opzichte van de andere stationomgevingen door de hoge mening van werknemers en inwoners en door het grote aanbod van mogelijk te ontwikkelen gebied. Het station Hoofddorp heeft een gemiddelde OV-bereikbaarheid en een hoge autobereikbaarheid.[n][n]Het te ontwikkelen gebied omvat zowel transformatie van bestaande woonwijken als verstedelijking van onbebouwd buitengebied. Het station ligt in de huidige situatie aan de rand van Hoofddorp. Door het ontwikkelen van de polders ten zuidoosten van de stad, komt het station midden in stedelijk gebied te liggen.', 'In 2010 vertrekken op dit station per uur 2 Intercity''s in 1 richting en 8 Sprinters verdeelt over 4 richtingen. De HOV-bus (Zuidtangent) rijdt op metrofrequentie richting Haarlem en Amsterdam-Zuid via Schiphol. Er vertrekken per uur 32 streekbussen verdeelt over 16 verschillende richtingen. HSL, lightrail en trams stoppen niet op dit station.[n][n]In de periode 2010-2014 worden de locaties Werkstad A4 via een HOV-bus aangesloten.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Haarlemmermeer', 'Stadsregio Amsterdam', 108, 185, 54, 46, 87, 107, 9, 48, 200, 38, 4, 1, 22, 133, 3313, 916, 415250, 32950, 16610, 1318),
(5, 'Nvp', 'Nieuw Vennep', '1', '', 'De omgeving van het station Nieuwe Vennep kenmerkt zich ten opzichte van de andere stationomgevingen door de hoogste menging van werknemers en inwoners en door het grootste ontwikkelgebied. Het station Nieuw Vennep heeft een lage OV-bereikbaarheid en een gemiddelde autobereikbaarheid.[n][n]Het te ontwikkelen gebied omvat zowel transformatie van bestaande woonwijken als verstedelijking van onbebouwd buitengebied. Het station ligt in de huidige situatie aan de rand van Nieuw Vennep. Door het ontwikkelen van de polders ten zuidoosten van de stad, komt het station midden in stedelijk gebied te liggen.', 'In 2010 vertrekken op dit station per uur 4 Sprinters verdeelt over 2 richtingen. Er vertrekken per uur 8 streekbussen verdeelt over 2 richtingen. HSL, Intercity''s, sneltreinen, lightrail en trams stoppen niet op dit station.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Haarlemmermeer', 'Stadsregio Amsterdam', 33, 160, 16, 93, 63, 90, 2, 48, 249, 38, 28, 2, 8, 204, 1501, 824, 92700, 57150, 3708, 2286),
(6, 'Ldn', 'Leiden Noord', '1', '', 'De omgeving van het toekomstige station Leiden Noord grenst aan het Groene Hart en kenmerkt zich door een lage OV- en Auto bereikbaarheid. De functiemenging in het gebied is laag en vooral op wonen gericht. De ontwikkelruimte in de toekomst bestaat deels uit transformatie en deels uit verstedelijking van onbebouwd gebied.[n][n]In het kader van project Nieuw Leyden, waarvoor inmiddels een masterplan is gemaakt, worden voornamelijk drie deelgebieden herontwikkeld: Het Slachthuisterrein, de Groenoordhallen en omgeving en het Kooiplein en omgeving.[n][n]Het geplande station vormt tevens een verbinding tussen de Leidse Merenwijk en Oegstgeest.', 'In 2010 bestaat dit station nog niet. Er vertrekken in de buurt van de locatie 8 streekbussen per uur verdeelt over 2 richtingen. HSL, Intercity''s, sneltreinen, lightrail en trams stoppen niet op dit station.[n][n]In de periode 2022-2026 wordt volgens planning het station Leiden Noord in gebruik genomen.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Leiden', 'Holland Rijnland', 1, 155, 47, 14, 154, 22, 6, 44, 174, 5, 16, 1, 1, 28, 7177, 812, 59275, 30875, 2371, 1235),
(7, 'Gvc', 'Den Haag CS', '1', '', 'Den Haag CS kent zowel een hoge OV-bereikbaarheid als een hoge autobereikbaarheid. Het gebied kenmerkt zich ook door gemiddelde functiemenging en een hoge inwoner- en werknemerdichtheid. Het gebied is overwegend op werken gericht. Den Haag CS heeft de minste ontwikkelruimte van alle stations uit de corridor. De ontwikkelruimte is vrijwel volledig gericht op transformatie van bestaand stedelijk gebied.[n][n]In 2014 moet het Den Haag Centraal station en omgeving vernieuwd en uitgebreid zijn, omdat in de toekomst meer mensen gebruik zullen maken van het station. Men verwacht de komende 10 jaar een verdubbeling van de huidige 190.000 reizigers die er dagelijks langskomen door de komst van de HSL en de RandstadRail. Het project ''Den Haag Nieuw Centraal'' (DHNC) bestaat uit vijf onderdelen: de verbetering en verbouwing van het Centraal Station tot een moderne OV-terminal, de bouw van kantoren en woningen op het Koningin Julianaplein, de ontwikkeling van het Anna van Buerenplein tot een aantrekkelijk ontmoetingspunt, de modernisering en uitbreiding van het winkel- en dienstencentrum Babylon, en de overbouwing van het busplatform. ', 'Den Haag CS is met 12 sporen het grootste kopstation van Nederland. In 2010 vertrekken vanaf dit station per uur in totaal 8 Intercity''s of Sneltreinen en 30 Lightrail''s verdeeld over 5 verschillende richtingen en 4 Sprinters verdeeld over 2 verschillende richtingen. Daarnaast vertrekken per uur 96 trams verdeeld over 16 verschillende richtingen en 46 bussen verdeeld over 19 verschillende richtingen.[n][n]Bij Den Haag CS komt in 2014 een nieuw Randstadrail station voor het Haags Startstation E-lijn (HSE) dat direct in verbinding staat met het Centraal Station.[n][n]In 2013 zal de HSL Fyra vanaf Den Haag via Breda naar Brussel gaan rijden in twee-uursdiensten.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Intercity''s en 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Den Haag', 'Haaglanden', 299, 185, 257, 34, 110, 15, 48, 41, 60, 3, 5, 3, 0, 0, 7726, 114, 1315050, 115550, 52602, 4622),
(8, 'Gv', 'Den Haag HS', '1', '', 'Den Haag HS kenmerkt zich door een gemiddelde OV-bereikbaarheid en een lage autobereikbaarheid. Het gebied is gericht op wonen en de inwoners- en werknemerdichtheid is hoog. Den Haag HS heeft weinig ontwikkelruimte die vrijwel volledig is gericht op transformatie van bebouwd gebied.[n][n]Dagelijks maken 30.000 reizigers gebruik van dit station. Daarom moet de omgeving aan beide zijden van het station worden ontwikkeld tot een omgeving waar gewoond, gewerkt en gewinkeld kan worden. Op verschillende locaties in de Stationsbuurt vindt differentiatie en uitbreiding plaats van de woningvoorraad. Woningen zijn gesitueerd boven een plint met stedelijke voorzieningen. De openbare ruimte wordt speciaal ingericht voor langzaam verkeer; het stationsgebied krijgt een autoluw karakter. De datum van oplevering van de verschillende projecten is onduidelijk. Het bedrijventerrein Binckhorst moet in 2030 onder de naam Nieuw Binckhorst zijn veranderd in een gebied met functiemenging van werken, wonen en leisure.', 'In 2010 vertrekken vanaf dit station per uur in totaal 14 Intercity''s of Sneltreinen verdeeld over 10 verschillende richtingen en 8 Sprinters verdeeld over 4 verschillende richtingen. Daarnaast vertrekken per uur 72 trams verdeeld over 12 verschillende richtingen en 24 bussen verdeeld over 6 verschillende richtingen. Op Den Haag HS stoppen geen HSL en Lightrail.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Den Haag', 'Haaglanden', 151, 105, 217, 44, 219, 41, 18, 40, 12, 10, 10, 2, 2, 0, 21650, 885, 545200, 28100, 21808, 1124),
(9, 'Gvmw', 'Den Haag Moerwijk', '1', '', 'Den Haag Moerwijk heeft een lage OV- en autobereikbaarheid. Het gebied kent een lage functiemenging en is overwegend op wonen gericht. De inwoner- en werknemerdichtheid is in vergelijking tot de andere stations gemiddeld. De ontwikkelingsruimte is gemiddeld en voor het grootste deel gericht op transformatie van bebouwd gebied.[n][n]Knoop Moerwijk is een gebied in Den Haag waar spoor, water, weg en zelfs groen door elkaar heen lopen. Dit is gevaarlijk voor het verkeer en heeft ook een rommelige uitstraling. Daarom wordt dit gebied geherstructureerd. Men wil meer woningen en passende voorzieningen rond het station mogelijk te maken. Ook moet de bereikbaarheid van de omliggende wijken met openbaar vervoer verbeteren. In totaal worden binnen  het plangebied ca. 800 woningen toegevoegd. Er is zo''n 35.000 m² gereserveerd voor voorzieningen, waarvan ca. 7.000 m² voor kleinschalige bedrijfsruimten en kleinschalige horeca. Of deze plannen (in hun geheel) worden uitgevoerd is door de crisis op het moment niet duidelijk.', 'In 2010 vertrekken vanaf dit station per uur in totaal 8 Sprinters verdeeld over 4 verschillende richtingen. Daarnaast vertrekken er 12 trams en 8 bussen verdeeld over 2 verschillende richtingen. Op Den Haag Moerwijk stoppen geen HSL, Intercity''s en Lightrail.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Den Haag', 'Haaglanden', 36, 110, 133, 20, 223, 25, 8, 133, 13, 38, 8, 3, 4, 0, 19413, 3129, 218650, 67700, 8746, 2708),
(10, 'Rw', 'Rijswijk', '1', '', 'Rijswijk heeft de hoogste autobereikbaarheid van alle stations in deze corridor. De OV-bereikbaarheid is aan de lage kant. De functiemenging is laag en de inwoner- en werknemerdichtheid is gemiddeld. De ontwikkelruimte is ook gemiddeld en richt zich vooral op transformatie van bebouwd gebied.[n][n]Door de herstructurering van delen van het stationsgebied, wordt er voornamelijk voorzien in de woningbehoefte. Zo worden in 2011 bij het winkelcentrum In de Boogaard 120 appartementen gerealiseerd. Ook wordt in het gebied rondom het station Rijswijk het verouderde bedrijventerrein Plaspoelpolder geherstructureerd. ', 'In 2010 vertrekken vanaf station Rijswijk per uur 8 Sprinters verdeeld over 4 verschillende richtingen. Daarnaast vertrekken er in totaal 12 trams verdeeld over 2 verschillende richtingen en 22 bussen verdeeld over 7 richtingen. Er stoppen op dit station geen HSL, Intercity''s en Lightrail.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Rijswijk', 'Haaglanden', 39, 280, 92, 63, 208, 58, 30, 107, 25, 31, 19, 10, 6, 0, 10528, 1257, 379875, 124650, 15195, 4986),
(11, 'Dt', 'Delft', '1', '', 'De OV-bereikbaarheid van Delft is laag tot gemiddeld. De autobereikbaarheid is laag. Het gebied is overwegend een woongebied. De functiemenging is laag en de inwoner- en werknemerdichtheid is gemiddeld. De ontwikkelruimte is gemiddeld en volledig gericht op transformatie van bestaande bebouwing.[n][n]In de omgeving van station Delft wordt voornamelijk woningbouw gerealiseerd. Naast koop- en (sociale)huurwoningen wordt er ook aandacht besteed aan studentenwoningen. De directe aanleiding voor de herstructurering van de Spoorzone is de vervanging van het Delfts spoorwegviaduct door een spoortunnel. Hierdoor kan de Spoorzone plaats gaan bieden aan een spoorwegstation annex stadskantoor, bijna 1500 woningen, enkele kantoren en een stadspark. De voltooiing van het complete project staat gepland voor 2020. De Schie-oevers worden in de komende 20 jaar getransformeerd van een extensief bedrijventerrein tot een aantrekkelijk en duurzaam woon-werkgebied. In 2030 moet dit project voltooid zijn.', 'In 2010 vertrekken vanaf station Delft per uur in totaal 8 Intercity''s of Sneltreinen en 8 Sprinters verdeeld over 4 verschillende richtingen. Daarnaast vertrekken er in totaal 12 trams verdeeld over 2 verschillende richtingen en 30 bussen verdeeld over 15 richtingen. Er stoppen op dit station geen HSL en Lightrail.[n][n]De spoorbaan op het traject Den Haag – Rotterdam wordt verdubbelt en dit betekent dat in Delft een spoortunnel moet worden aangelegd. Het station zelf zal ondergronds worden gebouwd.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Delft', 'Haaglanden', 102, 115, 152, 34, 263, 36, 44, 61, 17, 22, 5, 2, 2, 0, 20695, 1342, 408175, 45400, 16327, 1816),
(12, 'Dtz', 'Delft Zuid', '1', '', 'Delft-Zuid kent een hoge autobereikbaarheid en een lage OV-bereikbaarheid. Het gebied heeft de laagste functiemenging van de corridor en een lage inwoner- en werknemerdichtheid. Het gebied is overwegend een woongebied. Delft-Zuid heeft veel ontwikkelruimte die grotendeels wordt benut door transformatie van bestaand bouwgebied, maar er wordt ook in onbebouwd gebied ontwikkeld.[n][n]Het station Delft-Zuid krijgt een nieuw stationsgebouw waarbij ook kantoren en winkels worden gerealiseerd. De TU wijk wordt tegelijkertijd opgeknapt. De projecten moeten in 2013 klaar zijn. De Voorhof Zuidwest moet een gedifferentieerd gebied worden waar wonen, groen, leisure en zorg verenigd zijn. De Technopolis in Delft moet over 20 jaar volledig met kennisintensieve bedrijven bezet zijn. Technopolis wordt één van de belangrijkste kennislocaties van Europa. Het project Schie-oevers ''Blauw'' moet ex-studenten aan Delft binden. Nu vertrekt het overgrote deel van de studenten na hun studie naar andere steden. De Schiehallen zullen, onder de naam SchieFabriek, worden omgebouwd tot flexibele woon/werk ruimtes. In 2030 zal het project voltooid worden.', 'In 2010 vertrekken vanaf station Delft-Zuid per uur in totaal 8 Sprinters verdeeld over 4 verschillende richtingen. De HSL, Intercity, Lightrail, tram en bus stoppen niet op dit station.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Delft', 'Haaglanden', 27, 170, 78, 35, 177, 110, 27, 66, 42, 24, 93, 3, 10, 10, 10630, 1464, 213500, 163075, 8540, 6523),
(13, 'Sdk', 'Schiedam Kethel', '1', '', 'Schiedam Kethel is een wijk in Schiedam met zowel een lage OV- als autobereikbaarheid. Het gebied heeft een lage functiemenging en inwoner- en werknemerdichtheid. Het gebied is gericht op werken. Schiedam Kethel heeft veel open ruimte. De geplande ontwikkelruimte ligt met name in onbebouwd gebied, maar doordat dit gebied onderdeel uitmaakt van het aanvlieggebied van Rotterdam The Hague Airport, kan deze ruimte niet benut worden voor woningbouw.[n][n]Het ontwikkelproject Sveaparken bestaat uit de realisatie van woningen, winkels en zorgvoorzieningen. Het project zal zo goed als zeker in 2013 afgerond zijn. Verder hebben het Uitvoeringsplan Stedelijke Projecten Rotterdam en het Ruimtelijk Plan Regio Rotterdam 2020 op de lange termijn invloed op de ontwikkeling van de wijk. ', 'Schiedam Kethel is vooralsnog geen treinstation, maar alleen een wijk in Schiedam. In deze wijk stoppen in totaal per uur 4 bussen verdeeld over 2 verschillende richtingen.[n][n]Het plan om het spoorboekloos reizen te introduceren kan heel goed leiden tot de realisatie van een treinstation in dit gebied. Als dat gebeurt zullen er dezelfde treinen rijden als op station Delft-Zuid. Dat zijn per uur in totaal 8 Sprinters verdeeld over 4 verschillende richtingen. De HSL, Intercity, Lightrail en tram stoppen dan waarschijnlijk niet op dit station.', 'Schiedam', 'Stadsregio Rotterdam', 3, 110, 31, 71, 77, 121, 1, 68, 180, 0, 5, 0, 3, 20, 2505, 0, 201650, 4775, 8066, 191),
(14, 'Sdm', 'Schiedam Centrum', '1', '', 'Het station Schiedam Centrum heeft een hoge OV-bereikbaarheid en een lage autobereikbaarheid. De functiemenging is laag en de inwoner- en werknemerdichtheid is gemiddeld. Het gebied wordt getypeerd als een woongebied. Er is veel geplande ontwikkelruimte, zowel in onbebouwd als bebouwd gebied.[n][n]Alle projecten in Schiedam, die in 2013 voltooid moeten zijn, hebben overwegend een woonfunctie. Het project Schieveste is gedifferentieerder. Het bestaat uit zestien hectaren met kantoren, scholen, een hotel, woningen, stedelijk vermaak en een grote P&R-garage. Het moet in 2017 voltooid zijn. het Uitvoeringsplan Stedelijke Projecten Rotterdam zal in 2020 voltooid zijn en met name betrekking hebben op werkgelegenheid.', 'In 2010 vertrekken vanaf dit station per uur in totaal 4 Sneltreinen verdeeld over 2 verschillende richtingen en 16 Sprinters verdeeld over 6 verschillende richtingen. Daarnaast vertrekken per uur 24 Lightrail''s en 24 trams verdeeld over 4 verschillende richtingen. Er vertrekken 58 bussen per uur verdeeld over 19 verschillende richtingen. Op Schiedam Centrum stopt geen HSL.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Schiedam', 'Stadsregio Rotterdam', 201, 215, 87, 53, 152, 156, 16, 97, 24, 3, 50, 2, 15, 5, 11044, 181, 335500, 56050, 13420, 2242),
(15, 'Rtd', 'Rotterdam CS', '1', '', 'Rotterdam CS heeft de hoogste OV-bereikbaarheid uit de corridor. De autobereikbaarheid is daarentegen het laagst. De menging van werknemers en inwoners is hoog, net als de inwoner- en werknemerdichtheid. De ontwikkelruimte op Rotterdam CS is gemiddeld en vind met een kleine meerderheid plaats op nog onbebouwd gebied.[n][n]De OV-terminal van Rotterdam CS zal in 2013 klaar zijn, net als de meeste nieuwbouwprojecten in Rotterdam. Het station krijgt per dag 110.000 reizigers te verwerken. Door de komst van de HSL-Zuid naar Brussel en de RandstadRail is de verwachting dat het aantal reizigers op Rotterdam Centraal in 2025 zal zijn toegenomen tot zo''n 323.000 per dag. Het station zal plek bieden aan uiteenlopende stedelijke functies. De stationsomgeving moet in 2018 klaar zijn.', 'In 2010 vertrekt vanaf Rotterdam Centraal per uur in totaal 4 keer een HSL verdeeld over 2 verschillende richtingen. Er vertrekken ook 18 Intercity''s of Sneltreinen verdeeld over 13 verschillende richtingen en 14 Sprinters verdeeld over 6 verschillende richtingen. Daarnaast vertrekken per uur 6 Lightrail''s in 1 richting. Er vertrekken 78 trams per uur verdeeld over 13 verschillende richtingen en 80 bussen verdeeld over 14 richtingen.[n][n]De HST Fyra zal op zijn vroegst eind 2011 tussen Rotterdam en Brussel rijden. Rotterdam Centraal krijgt ook een verbinding met de Lightrailverbinding Randstadrail.[n][n]Project Spoorboekloos Reizen (MIRT - Randstad) streeft naar frequentieverhoging van het aantal Sprinters en Intercity''s naar 6 per uur in 2028. Bij viersporige infrastructuur is een capaciteit van 8 Sprinters per uur technisch haalbaar.[n][n]Project Stedenbaan (Zuidvleugel) streeft naar een versnelde frequentieverhoging van het aantal Sprinters naar 6 per uur in 2018, vervolgens naar 8 per uur.', 'Rotterdam', 'Stadsregio Rotterdam', 440, 100, 223, 63, 244, 15, 36, 84, 0, 28, 20, 12, 5, 0, 22559, 1747, 818150, 304175, 32726, 12167),
(16, 'Ut', 'Utrecht Centraal', '1', '', 'Het project CU2030 voorziet in ingrijpende transformatie van het stationsgebied van Utrecht Centraal. Dit stationsgebied is een op zichzelf staand gebied in Utrecht dat erg populair is en weinig last ondervindt van de economische crisis. Waar kantoren elders leeg komen te staan, is er rondom Utrecht Centraal veel vraag naar kantoorruimte. Het programma voor het stationsgebied staat vast en wordt in verschillende fases, in ieder geval doorlopend tot 2030, uitgevoerd. Dit hoogstedelijke programma dient zo goed mogelijk uitgevoerd te worden in de simulatie.[n][n]De ‘Kop van Lombok’ wordt in de periode tussen 2010-2014 verder getransformeerd. Het gebied geeft ruimte aan woningen, kantoren, een moskee en kleinschalige voorzieningen. \r\nOok wordt de nieuwe Utrechtse wijk ‘Zijdebalen’ gerealiseerd. Vlak langs de Vecht worden 450 zeer verschillende woningen gebouwd.[n][n]De voormalige sojafabriek Cereol, gevestigd langs de Kanaalweg, wordt in de periode 2014-2018 gerenoveerd en opnieuw in gebruik genomen voor een woon- en recreatiefunctie.', 'Station Utrecht Centraal is het grootste OV-knooppunt van Nederland. De stad is van plan de aantrekkingskracht van deze Railport nog beter te gaan benutten, door middel van het project CU2030. Dit project voorziet in ingrijpende transformatie van het station Utrecht Centraal. De HOV-tram naar de Uithof zal haar beginpunt krijgen op Utrecht Centraal.[n][n]Utrecht CS wordt bediend door meerdere internationale treinen, Intercity’s en Sneltreinen, Sprinters, HOV trams en HOV bussen.', 'Utrecht', 'Bestuur Regio Utrecht', 632, 120, 112, 43, 170, 34, 49, 74, 26, 17, 11, 12, 17, 1, 19593, 1313, 1124125, 260700, 44965, 10428),
(17, 'Utvr', 'Utrecht Vaartsche Rijn', '1', '', 'Het Ledig Erf en omgeving, ten noorden van het station, transformeert de laatste jaren tot hip en bruisend recreatiegebied. In de periode 2010-2014 vinden er kleinschalige transformaties plaats in de vorm van extra horecaruimte. In de nabijheid worden 43 appartementen gerealiseerd.[n][n]Het bedrijventerrein van de Merwede Kanaalzone wordt in fases geherstructureerd. Doordat de stad over het kanaal is gegroeid, liggen de bedrijven nu centraal gesitueerd. Het gebied is daardoor beter geschikt voor een woon- of kantoorfunctie. Er worden in de periode 2010-2014 1000 campusappartementen gerealiseerd.[n][n]In de periode tussen 2014-2018 wordt een deel van de Rubenslaan en Lodewijk Napoleonplatsoen gerenoveerd. Rotsoord, een bedrijventerrein met onder meer het poppodium Tivoli de Helling, wordt in de periode 2018-2022 geherstructureerd. Het verrommelde gebied wordt getransformeerd tot een hoogwaardig cultureel recreatiegebied, met lokale/regionale functie.[n][n]Het deel van de Merwede Kanaalzone, tegenover Parkhaven, is in handen van Defensie. In de periode 2022-2026 wordt deze grond verkocht aan gemeente Utrecht en bouwrijp gemaakt. ', 'In 2015 wordt station Utrecht Vaartsche Rijn in gebruik genomen, een brug-gebouw over de Vaarsche Rijn. Wanneer de NS ook daadwerkelijk treinen gaat laten stoppen is nog niet duidelijk. Het station moet een belangrijk overstapstation worden voor reizigers vanuit het zuiden (uit de richting Arnhem en ''s-Hertogenbosch) naar universiteitscentrum De Uithof. [n][n]De nieuw aan te leggen trambaan naar de Uithof, zal dit station aandoen. Op het station zelf zullen geen voorzieningen worden gerealiseerd, omdat er vooral nadruk gelegd wordt op de overstapvoorziening en het bedieningsgebied wordt gericht op de directe omgeving.[n][n]Utrecht Vaartsche Rijn zal in de toekomst worden bediend door Sprinters en HOV trams. Of het een Intercitystation wordt is nog onduidelijk.', 'Utrecht', 'Bestuur Regio Utrecht', 164, 130, 76, 8, 191, 51, 7, 52, 24, 6, 44, 1, 2, 0, 16911, 588, 304800, 91075, 12192, 3643),
(18, 'Bnk', 'Bunnik', '1', '', 'Een kavel nabij de provinciale weg wordt in de periode van 2014 gereedgemaakt voor de realisatie van 25 woningen. Tussen het spoor en de Stationsweg is ruimte voor de realisatie van 140 woningen, indien de bestaande houthandel elders gehuisvest kan worden. Gemeente Bunnik heeft hiervoor het bedrijventerrein Raaphof in gedachten, ten zuiden van de A12.[n][n]Hiervoor moet worden onderhandeld met de provincie over de rode contouren, waardoor de uitbreiding van het bedrijventerrein niet plaatsvindt vóór 2018. Tussen het Jaagpad en de Boschhoeve komt in 2018 ruimte voor waterberging, extensieve recreatie en ongeveer 30 woningen.[n][n]Met het project ‘Nieuwe wijk voor Odijk’ worden tussen 2014-2018 ca. 1000 woningen gerealiseerd in een uitleglocatie ten westen van Odijk. Deze ontwikkelingen leiden waarschijnlijk niet tot drukte op station Bunnik, omdat de concurrerende busverbinding van Odijk naar Utrecht dusdanig frequent is, dat overstappen op de Sprinter geen zin heeft.\r\nIn de periode tussen 2022 – 2030 krijgen de landelijke recreatieve voorzieningen ten zuidoosten van de A12 een nieuwe impuls.', 'Station Bunnik heeft een lokale functie en vanuit de gemeente is er geen ambitie om dit station op te waarderen. Gelegen tussen de grotere stations Utrecht Centraal en Driebergen-Zeist heeft dat geen meerwaarde. Wel wordt hard gewerkt aan een verbeterde fietsroute van Houten via Bunnik naar de Uithof (Sciencepark) in Utrecht en verder door naar Bilthoven. Tussen 2015 en 2020 wordt er tevens een stationstunnel gerealiseerd, waardoor station Bunnik beter ontsloten wordt voor autoverkeer. Het gevolg hiervan is dat er rondom het station meer ruimte vrijgemaakt moet worden voor P&R. De mogelijke ontsluitingsweg Houten – A12 biedt kansen voor de ontwikkeling van het bedrijventerrein Raaphof.[n][n]Bunnik wordt bediend door Sprinters.', 'Bunnik', 'Bestuur Regio Utrecht', 21, 295, 10, 32, 109, 42, 7, 39, 275, 7, 7, 3, 1, 71, 1609, 135, 122650, 14775, 4906, 591),
(19, 'Db', 'Driebergen-Zeist', '1', '', 'Het stationsgebied Driebergen-Zeist ligt in 2 gemeenten. Gemeente Zeist werkt samen met gemeente Utrechtse Heuvelrug aan een gebiedsvisie voor het stationgebied van Driebergen-Zeist, die 2012 gereed is. Afstemming tussen de ruimtelijke plannen van deze twee gemeenten is daardoor cruciaal.[n][n]In de gemeente Zeist zal verdichting plaatsvinden. In totaal worden de komende 20 jaar 800 woningen binnenstedelijk toegevoegd. De gemeente ziet het stationsgebied niet als potentiële woonlocatie, omdat deze wijk dan te ver geïsoleerd zou liggen t.o.v. voorzieningen.[n][n]Kantorenpark de Breul wordt in de periode 2010-2014 uitgebreid, o.a. door uitbreiding van het hoofdkantoor van Heinz. In de wijk Kerkebos vindt de grootste ontwikkeling plaats: gefaseerd zullen verouderde flats gesloopt worden en plaatsmaken voor nieuwe gestapelde appartementen. Het aantal flats zal van 800 toenemen tot 1200. Het project loopt van 2010-2025. De dure serviceflats langs de Arnhemsebovenweg zijn achterhaald en aan vervanging toe. Ligging in de EHS maakt transformatie en uitbreiding lastig. Veranderingen vinden daardoor gefaseerd plaats vanaf het jaar 2020.[n][n]Beide gemeenten zien opgaven direct rond het station, met als doel de ruimtelijke kwaliteit te verbeteren. Het winkelcentrum bij Driebergen-Zeist wordt in de periode 2014-2018 vernieuwd. De bedrijven aan de Zeisterkant van het station worden tussen 2010 en 2020 geherstructureerd. Heuvelrug heeft de ambitie na 2020, als het nieuwe station is gerealiseerd, 4 hectare aan kantoren en voorzieningen te realiseren. Ook moet er ruimte komen voor ongeveer 50 woningen. Het hoofdkantoor van de KLPD is gesitueerd nabij het station en de A12. Door de onzekere toekomst van het KLPD kan het kantoor in de toekomst in omvang afnemen. De vrijgekomen ruimte is geschikt voor herontwikkeling. In 2026 kan sportpark ten zuiden van het station ontwikkeld worden voor stedelijke functies nabij het station.[n][n]Door de ecologische hoofdstuctuur is het niet mogelijk aan de zuid-westelijke kant van het station stedelijk programma te realiseren.', 'Met betrekking tot verkeer en vervoer ervaart gemeente Zeist een doorstromingsprobleem van het bus-OV bij de Driebergseweg/Utrechtseweg. Door een viaduct bij het station en een betere aansluiting op de A12 moet dit probleem (deels) verholpen worden. De stad Utrecht is goed ontsloten met het regionaal busvervoer.[n][n]Het huidige parkeerterrein bij het station voldoet niet. Er is gebrek aan capaciteit en gemeente Zeist wil op termijn een parkeergarage realiseren nabij het station\r\nDe tramverbinding naar de Uithof krijgt wellicht een halte bij Driebergen-Zeist. Het exacte traject van deze tram ligt nog niet vast en mogelijke effecten en haalbaarheid moeten nog nader uitgezocht worden.[n][n]Driebergen-Zeist wordt bediend door Intercity’s en Sprinters. De Intercitystatus is in de toekomst echter niet zeker.', 'Zeist en Heuvelrug', 'Bestuur Regio Utrecht', 70, 255, 10, 6, 70, 24, 13, 31, 352, 23, 14, 9, 3, 55, 1825, 1034, 157425, 86175, 6297, 3447),
(20, 'Mrn', 'Maarn', '1', '', 'In de nabije toekomst staat herstructurering van twee woongebieden gepland. Verder in de toekomst zijn nog geen ontwikkelingen voorzien. Het groene en landelijke karakter van het dorp Maarn leent zich goed voor outdoor recreatie en verblijfsrecreatie in de vorm van bungalowparken en campings. Hier zou toekomstige ontwikkeling zich op kunnen richten.[n][n]Er zijn flinke woningbouwplannen rond Maarsbergen, verderop langs het spoor richting Veenendaal. Het is echter twijfelachtig of een nieuw station Maarsbergen levensvatbaar zou zijn.', 'Station Maarn wordt met PHS zeer goed bereikbaar. Het is echter de vraag in hoeverre men hiervan kan profiteren, omdat het dorp is ingesloten door beschermde groengebieden, waaronder de Ecologische Hoofdstructuur (EHS). Een mogelijkheid voor intensiever gebruik van het station zou zijn om een visgraatmodel toe te passen in het onderliggende busvervoer.[n][n]Maarn wordt bediend door Sprinters.', 'Heuvelrug', 'Regio Zuid Oost Utrecht', 20, 250, 14, 19, 116, 2, 2, 32, 302, 2, 0, 0, 0, 28, 2561, 190, 26800, 1550, 1031, 62),
(21, 'Vndw', 'Veenendaal West', '1', '', 'Nieuwe ontwikkelingen zijn echter niet waarschijnlijk. Het bebouwd gebied is ingesloten door beschermd landschap, waardoor uitleglocaties niet mogelijk zijn. Er staat een kleine inbreidingslocatie gepland op de korte termijn. Verder zijn er geen ruimtelijke plannen bekend.', 'PHS voorziet in een frequentieverhoging op dit station. \r\nVeenendaal West wordt bediend door Sprinters.', 'Veenendaal', 'Regio FoodValley', 22, 100, 39, 6, 188, 1, 4, 20, 196, 0, 0, 0, 1, 0, 5629, 27, 43550, 325, 1742, 13),
(22, 'Vndc', 'Veenendaal Centrum', '1', '', 'Er zijn voldoende ontwikkellocaties rond station Veenendaal Centrum, om van de goede bereikbaarheid te kunnen profiteren. Het stationsgebied van Veenendaal heeft nu al een redelijke bevolkingsdichtheid, door gestapelde bebouwing in de omgeving. Zo zijn er zelfs appartementen bovenop het stationsgebouw.\r\nEen laatste uitleglocatie, langs de provinciale weg, wordt binnenkort ontwikkeld. Er is ook gestart met een herstructurering in het centrum van Veenendaal, op loopafstand van het station. De hoeveelheid retail-oppervlak wordt daar fors uitgebreid door aanleg van een parallelle winkelstraat, die ook richting station zal lopen. Deze binnenstedelijke verdichtingsopgave sluit aan op de plannen voor Stationskwartier / De Ladder, een gebied rond het nieuwe gemeentehuis waar wonen en gemengde functies op het programma staan in de periode 2010-2018.[n][n]Bedrijventerrein Het Ambacht, gelegen langs het spoor, zal tussen 2014-2022 geherstructureerd worden. Deels zal dit gebied gebruikt worden voor uitbreiding van de meubelboulevard.', 'PHS voorziet in een frequentieverhoging op dit station. Er zijn goede busverbindingen met de omgeving. De bus naar station Veenendaal De Klomp geeft snel toegang tot de trein naar Arnhem. Er is sprake van een HOV-bus voor verbinding met het Food-Valley gebied, in de toekomst.\r\nVeenendaal Centrum wordt bediend door Sprinters.', 'Veenendaal', 'Regio FoodValley', 31, 160, 57, 12, 276, 44, 21, 19, 55, 26, 27, 11, 4, 11, 9280, 1091, 175325, 68025, 7013, 2721),
(23, 'Vndz', 'Veenendaal Zuid', '1', '', 'Tussen Veenendaal Centrum en Rhenen zijn op lange termijn meer ontwikkelbare gebieden voorhanden, deels in de vorm van herstructurering van extensieve bedrijventerreinen. Die ontwikkeling zou aanleiding kunnen geven voor het openen van een nieuw station: Veenendaal Zuid. Ook is de toekomstige vastgoedmarkt in het gebied lastig te voorspellen. In de simulatie zou hier ruimtelijk en vervoerskundig op kunnen worden ingespeeld.', 'Volgens de structuurvisie van Veenendaal zou dit nieuwe station ter plaatse van de Ringweg-Oost kunnen komen te liggen. De capaciteit op het spoor tussen Veenendaal en Rhenen is hier echter nog niet op berekend.[n][n]Veenendaal Zuid zou bediend kunnen worden door Sprinters.', 'Veenendaal', 'Regio FoodValley', 4, 95, 16, 17, 72, 115, 0, 21, 170, 0, 53, 0, 5, 110, 1919, 150, 104800, 37775, 4192, 1511),
(24, 'Rhn', 'Rhenen', '1', '', 'In Rhenen zal nog beperkt worden ontwikkeld. De bevolking groeit niet of nauwelijks meer en de strakke rode contouren en de Ecologische Hoofdstructuur (EHS) maken stedelijke uitbreiding lastig. Op één uitleggebied na, vinden de verwachte ontwikkelingen dan ook binnenstedelijk plaats. In de verdere toekomst is nog één uitleglocatie voorhanden, gesitueerd nabij het dorp Achterberg, ten oosten van de provinciale weg.[n][n]Met het project ‘Poorten en Groene Entrees’ wordt tot en met 2013 betere ontsluiting van het Nationaal Park Utrechtse Heuvelrug gerealiseerd, zowel per auto als OV. Hierdoor zal de extensieve recreatie in Rhenen en omgeving in de nabije toekomst een impuls krijgen. Het natuurgebied Kwintelooyen, gelegen tussen Rhenen en Veenendaal Centrum, zal worden ingericht als ‘Poort’ met een horecagelegenheid een informatiecentrum.[n][n]Tussen 2010-2014 vinden meerdere ontwikkelingen plaats: Door het vertrek van Kalkzandsteenfabriek CVK en de Connexxion-busremise aan de zuidoostkant van Rhenen is rond de eeuwwisseling de locatie Vogelenzang vrijgekomen voor 200 woningen en natuur. Aan de Veenendaalseweg wordt een gemeentekantoor, een garagebedrijf en een wooncomplex en andere panden gesloopt voor woningbouw.[n][n]Bij de Valleiweg/Lijsterberg vindt in de periode 2014-2018 herstructurering plaats van appartementen. Ten noorden van de Grebbeweg gaan bedrijven door ruimtegebrek verhuizen. Rond 2020 komt daardoor ruimte vrij voor nieuwe binnenstedelijke ontwikkeling. Een basisschool wordt vervangen, met toevoeging van 20 nieuwe woningen in de periode 2018-2022.[n][n]In de periode 2022-2026 wordt het bedrijventerrein aan de Rijnkade ten zuiden van de binnenstad getransformeerd. De ligging biedt kansen voor een hoger segment woningen.[n][n]Dierenpark Ouwehand is een belangrijke recreatieve trekker voor Rhenen en de dierentuin is goed te bereiken vanaf het station. Hoewel het Dierenpark omgeven is door EHS, zou er in de periode 2026-2030 uitbreiding van het park plaats kunnen vinden.', 'De grootste verkeersproblematiek kent Rhenen op de Provincialeweg (N233) tussen de A12 en A15. In de spitsuren staat de weg volledig vast door het problematische kruispunt nabij de Rijnbrug. Daarnaast eindigt de spoorlijn abrupt in Rhenen. Vroeger sloot de lijn aan op het spoor tussen Tiel en Elst, maar na bombardementen in WOII is deze verbinding niet meer in ere hersteld. Het tracé tussen Veenendaal en Rhenen is enkelspoors, waardoor frequentieverhoging kostbaar is.\r\nDe OV-bereikbaarheid tussen de kernen rondom Rhenen met het OV laat te wensen over. De Food Valley bij Wageningen Universiteit is per OV alleen goed ontsloten via station Ede-Wageningen. Snelbussen tussen de kernen bieden mogelijk een oplossing.[n][n]Rhenen wordt bediend door Sprinters.', 'Rhenen', 'Regio FoodValley', 33, 110, 24, 6, 139, 14, 4, 38, 257, 6, 1, 0, 8, 5, 3811, 166, 46600, 600, 1864, 24),
(25, 'Ed', 'Ede-Wageningen', '1', '', 'Er is een grote hoeveelheid ontwikkelruimte rond station Ede-Wageningen. Bij de gemeente Ede ligt de prioriteit bij ontwikkelingen rond dit station, pas daarna bij station Veenendaal-De Klomp. Momenteel worden een conferentieoord Reehorst en een bedrijventerrein ten zuiden van het station getransformeerd, tot woningen en onderwijsvoorzieningen.[n][n]De gehele spoorzone en het stationsplein zullen op korte termijn ook worden aangepakt. Vervolgens is een gemengd stedelijk gebied gepland ter plekke van de Veluwse Poort, ten zuidoosten van het station. Later zal ook het huidige Kazerneterrein van Defensie worden herontwikkeld, aan weerszijde van de Nieuwe Parklaan.', 'PHS voorziet in een frequentieverhoging op dit station. Er zijn goede busverbindingen met het stedelijk gebied van Ede en met bestemmingen in de FoodValley-regio. Over ca. 10 jaar zal ten oosten van het station de Nieuwe Parklaan worden aangelegd, die het spoor kruist nabij het stationsplein.', 'Ede', 'Regio FoodValley', 107, 100, 37, 53, 186, 60, 34, 30, 107, 46, 47, 25, 13, 18, 4322, 1290, 133725, 53000, 5349, 2120),
(26, 'Klp', 'Veenendaal-De Klomp', '1', '', 'Er zijn diverse mogelijke ontwikkellocaties rond station Veenendaal- De Klomp. De vraag is wel in hoeverre het stationsgebied als geheel tot ontwikkeling kan komen, omdat het deels op Veenendaals en deels op Ede’s grondgebied ligt. Bij de gemeente Ede ligt de prioriteit bij het station Ede-Wageningen, daarna pas De Klomp. In eerste instantie kan het bedrijventerrein De Klomp West worden uitontwikkeld. Na gereedkomen van de nieuwe rondweg, rond 2015, ligt het bedrijventerrein De Klomp Oost voor de hand.[n][n]In de driehoek tussen het spoor, de N-weg en het stationsplein zouden vanaf 2018 woningen kunnen worden gebouwd. Het gebied ten noorden van het spoor is verder landelijk van karakter. Op langere termijn kunnen hier extensieve recreatievoorzieningen komen, waaronder horeca. In het gebied rond het fort dient rekening te worden gehouden met het vrije schootsveld. De lintbebouwing tussen het station en het centrum kan vanaf 2022 kunnen worden verdicht.', 'PHS voorziet in een frequentieverhoging op dit station. Er zijn goede busverbindingen met het stedelijk gebied van Ede en met bestemmingen in de FoodValley-regio. De bus naar station Veenendaal Centrum geeft snel toegang tot de trein naar Rhenen. Er is sprake van een HOV-bus voor verbinding met het FoodValley gebied, in de toekomst.[n][n]Veenendaal- De Klomp wordt momenteel bediend door Sprinters en Intercity’s. Het is echter de vraag of de Intercity-status in de toekomst behouden zal blijven. Er is een rondweg gepland, die het station zal verbinden met de toekomstige bedrijventerreinen en Veenendaal Oost. Zodra die weg gereed is, zal de verbinding van De Klomp met het centrum, onder de A12, gesloten worden voor autoverkeer.', 'Veenendaal en Ede', 'Regio FoodValley', 36, 280, 15, 40, 26, 79, 1, 61, 285, 3, 4, 1, 17, 86, 849, 111, 122450, 4750, 4898, 190),
(27, 'Amr', 'Alkmaar', '1', '', 'Stationsgebied Alkmaar is een integrale ontwikkeling van ProRail, NS en de gemeente. Een groot deel van de grond is in eigendom van de NS. De integrale oplossingen voor onder andere fietsparkeren passen echter niet bij de verschillende subsidieregelingen. Er is daarom sprake van een stroef proces.[n][n]De ontwikkeling van Overstad moet, door transformatie van een groot bedrijventerrein aan het kanaal, het centrum van Alkmaar uitbreiden met nieuwe voorzieningen en woningen. De Kanaalvisie is gericht op het verbeteren van de verbinding tussen het stationsgebied, centrum en Overstad. Momenteel vormt het kanaal nog een barrière. Op Overstad wordt nu een hotel en een bioscoop gebouwd, maar verder komt de ontwikkeling nog niet van de grond. Er is o.a. een grote hoeveelheid aan grondeigenaren en een te grootschalig masterplan voor de huidige tijd.', 'Op station Alkmaar stoppen Intercity’s naar Den Helder, Nijmegen, Maastricht, Haarlem en Hoorn. Er is overstap mogelijk op 10 buslijnen.[n][n]Volgens de huidige plannen is Alkmaar het eindpunt van de noordelijke corridor van Programma Hoogfrequent Spoor.[n][n]Begin 2012 werd een Taskforce Ruimtewinst georganiseerd door de provincie, met betrekking tot het stationsgebied van Alkmaar. Een voorstel om het nieuwe busstation aan de achterzijde van het station te plaatsen leidde bij de gemeente tot discussie.\r\n', 'Alkmaar', 'Alkmaar', 106, 205, 100, 80, 256, 36, 27, 38, 53, 9, 17, 6, 8, 0, 9946, 189, 457525, 103750, 18301, 4150),
(28, 'Amrn', 'Alkmaar Noord', '1', '', 'Er is een gebiedsvisie ontwikkeld voor het stationsgebied Alkmaar-Noord. Verder zijn daar nu weinig concrete plannen.', 'Op station Alkmaar Noord stoppen Intercity’s naar Den Helder, Nijmegen, Maastricht, Haarlem en Hoorn. Er is overstap mogelijk op 2 buslijnen.', 'Alkmaar', 'Alkmaar', 70, 173, 48, 26, 210, 18, 9, 35, 139, 2, 8, 2, 1, 5, 6864, 0, 102200, 15300, 4088, 612);
INSERT INTO `station` (`id`, `code`, `name`, `variant`, `description_facts`, `description_background`, `description_future`, `town`, `region`, `POVN`, `PWN`, `IWD`, `MNG`, `area_cultivated_home`, `area_cultivated_work`, `area_cultivated_mixed`, `area_undeveloped_urban`, `area_undeveloped_rural`, `transform_area_cultivated_home`, `transform_area_cultivated_work`, `transform_area_cultivated_mixed`, `transform_area_undeveloped_urban`, `transform_area_undeveloped_rural`, `count_home_total`, `count_home_transform`, `count_work_total`, `count_work_transform`, `count_worker_total`, `count_worker_transform`) VALUES
(29, 'Asd', 'Amsterdam Centraal', '1', NULL, 'Amsterdam CS is het belangrijkste knooppunt van de stad op dit moment. Veel reizigers hebben echter bestemmingen in andere delen van Amsterdam. Het recente voorstel van wethouder Wiebes voorziet in het spreiden van forenzen en bezoekers over de andere Intercity-stations, zoals Amstel, Sloterdijk, Amsterdam Zuid en Bijlmer-Arena. Door het aanleggen van de Noord-Zuidlijn zal de knoop echter niet minder druk worden.[n][n]Men werkt al geruime tijd aan verbetering van het knooppunt Amsterdam Centraal. Die plannen lopen tot 2020. ProRail en NS verbeteren het station zelf, met o.a. 2 nieuwe doorgangen die ‘poortvrij’ zijn, voor de verbinding van de voor- en achterzijde van het station. Deze vormen direct 2 winkelgalerijen. De IJhal aan de noordzijde, met functie detailhandel, verbindt de verschillende doorgangen met elkaar.[n][n]Er komt een nieuw stationsplein, met nieuwe inrichting van de openbare ruimte. Er bevinden zich grote werkgevers binnen het stationsgebied, zoals TomTom, Douwe Egberts hoofdkantoor, het Gerechtshof en de Beurs.', 'Op Amsterdam CS stoppen internationale treinen naar Parijs en Frankfurt; Intercity’s naar Rotterdam, Maastricht, Den Helder, Nijmegen, Den Haag, Lelystad, Amersfoort en Enkhuizen; en Sprinters naar Almere, Hoofddorp, Zandvoort, Uitgeest en Rotterdam. Er kan worden overgestapt op 3 metrolijnen en 10 HOV-bussen, alsmede op 11 trams en 17 buslijnen.[n][n]De Noord-Zuidlijn van de metro komt gereed in 2017. Er wordt een nieuw busstation gerealiseerd aan de noordzijde met een ondergrondse autotunnel, kiss&ride autolussen en taxistandplaats. Er is een stalling voor 10.000 fietsen voorzien en misschien moet dit nog wel meer worden. Veel mensen vanuit het centrum komen lopend of met de fiets. Op dit moment wordt een nieuwe fietstunnel aangelegd onder het station door.[n][n]Nu stoppen bijna alle bussen en trams bij Amsterdam Centraal. Dit zou meer gespreid moeten worden. Van een aantal buslijnen uit het noorden zal het eindpunt worden verplaatst naar Buikslotermeerplein.', 'Amsterdam', 'Stadsregio Amsterdam', 978, 70, 208, 88, 172, 28, 32, 70, 149, 3, 11, 2, 5, 3, 21644, 165, 1096725, 100750, 43869, 4030),
(30, 'Ass', 'Amsterdam Sloterdijk', '1', NULL, 'Op dit moment wordt er gewerkt aan een gebiedsvisie voor Sloterdijk, om het station en de stationsomgeving aan te passen aan de wensen van deze tijd. Het proces verloopt niet optimaal, door lastige samenwerking tussen NS, ProRail en de gemeente. De opgave omvat  het verbeteren van de verbinding met de directe omgeving, waaronder het plein, en het toekomstbestendig maken van het omliggende gebied. Er is nu 20 procent leegstand van kantoren en de kans dat dit sneller oploopt dan gemiddeld is groot door de grote spelers, die in dit gebied gevestigd zijn. De gebiedsvisie gaat uit van 3 thema’s:[n][n]1. Variëren: van monofunctioneel naar multifunctioneel. De komende 10 jaar wordt ingezet op de transformatie van kantoren naar wonen in het gebied ten zuiden van het spoor. Met realisatie van geluidswerende voorzieningen mag hier gewoond worden. Onderwijs, zorg en leisurefuncties kunnen tevens worden gerealiseerd aan de noord-zijde van het spoor, dichter bij de havens. Er zijn plannen voor 800 permanente studentenwoningen.[n][n]2. Verblijven: toevoegen van functies die bijdragen aan de levendigheid in het gebied. Holiday Inn heeft zich al gevestigd in een oud kantoorpand. Er worden extended stay woningen gerealiseerd. Ook wordt er gezocht naar tijdelijke stedelijke functies voor de nog lege kavels.[n][n]3. Verankeren: het gebied is erg naar binnen gekeerd. Ambitie is om het groen vanuit oost en west meer het gebied in te brengen en te verbinden, waardoor aantrekkelijke routes door het gebied ontstaan. Ook de verbinding tussen het stationsgebied en het woongebied aan de zuidzijde moet sterker worden. Door de twee gebieden aan elkaar te koppelen kan er uitwisseling plaatsvinden. Men streeft ernaar de bestaande gebruikers zoveel mogelijk te behouden.', 'Het kruisingstation Sloterdijk is qua hoeveelheid in- en uitstappers het tweede station van Amsterdam en het zevende station van Nederland. Op Amsterdam Sloterdijk stoppen Intercity’s naar Den Helder, Maastricht, Nijmegen, Amsterdam Centraal, Vlissingen, Den Haag, Amersfoort en Enkhuizen. Ook stoppen er Sprinters naar Uitgeest, Rotterdam, Amsterdam en Zandvoort. Er kan worden overgestapt op metro en HOV-bus, op een tram en op 8 buslijnen.[n][n]Er is uitbreiding van de fietsenstalling met 1200 plaatsen gepland. Daarnaast wordt de P&R verdubbeld van 200 naar 400 parkeerplaatsen en 200 plaatsen voor kort parkeren.', 'Amsterdam', 'Stadsregio Amsterdam', 398, 313, 99, 43, 86, 187, 5, 87, 87, 7, 70, 1, 22, 4, 5913, 371, 781800, 1710942, 31272, 17109),
(31, 'Cas', 'Castricum', '1', NULL, 'Castricum is een poort naar de duinen. Ten westen van station Castricum ligt het beoogde ontwikkelgebied De Zanderij. Op dit moment bevinden zich daar sportvelden en een kaarsfabriek. Eind jaren 90 lagen er ambitieuze plannen voor dit gebied, die niet door de provincie werden goedgekeurd. Inmiddels ligt er een goedgekeurde gebiedsvisie uit 2008. De ambitie is om een nieuw landschap te maken dat een relatie heeft met de duinen en het nollenlandschap, waaronder toeristische en recreatieve functies kunnen worden gerealiseerd. De provincie zal in ieder geval een archeologisch centrum gaan realiseren, met een verwacht bezoekersaantal van 30.000 per jaar. Verder wordt er qua ontwikkeling op de Zanderij vooral gedacht aan vrijstaande en gestapelde woningen.', 'Op station Castricum stoppen Intercity’s naar Den Helder, Maastricht, Nijmegen, Haarlem en Hoorn. Er kan worden overgestapt op 2 buslijnen.[n][n]ProRail realiseert in 2015 een nieuw stationsgebouw in Castricum. Op dit moment is een nieuwe fietsenstalling in aanbouw van ca. 1200 plekken.[n][n]De spoorwegovergang van de Beverwijksestraatweg is vaak dicht. Met de komst van Programma Hoogfrequent Spoor zal dit stijgen naar ruim de helft van de tijd. De wens van de gemeente is om hier een tunnel onder het spoor te maken, maar daar zijn nog onvoldoende middelen voor. Naast een tunnel op het huidige traject is er ook een ‘westvariant’ ontworpen, waarbij de ontsluitingsweg aan de duinzijde van het spoor komt te liggen, bij de nieuwe ontwikkelingen. De provincie, essentieel voor de financiering van de tunnel, sprak zich uit tegen die variant.', 'Castricum', 'Alkmaar', 68, 110, 27, 26, 133, 9, 5, 23, 283, 3, 4, 1, 3, 4, 4264, 43, 64250, 4600, 2570, 184),
(32, 'Hwd', 'Heerhugo&shy;waard', '1', '', 'Heerhugowaard speelt als tuinstad en groeikern in op de woningvraag die gegenereerd wordt door Amsterdam en Alkmaar, bijvoorbeeld in uitleggebieden richting Schermer en Beemster. De stad verzorgt tevens een regionaal voorzieningenaanbod.[n][n]Er is een integrale visie ontwikkeld voor het stationsgebied. Eén van de doelstellingen is om het bedrijventerrein aan de rand van de stad te transformeren tot een bruisend verlengstuk van het stadshart. De hoofdkantoren van het Hoogheemraadschap en Ziggo hebben zich hier al gevestigd.[n][n]Tegenover het ROC wordt een praktijkschool voor gezondheidszorg ontwikkeld en het nieuwe specialistische ziekenhuis komt ook in het gebied te liggen, nabij de gemeentegrens. Het bedrijventerrein langs het spoor zal worden  getransformeerd tot de “Boulevard van lichaam en geest”. Dit gaat in combinatie met het nieuwe ziekenhuis een economische impuls geven. De stationsomgeving wordt tegelijk groener gemaakt en toch verdicht, door compacte woningen te ontwikkelen rond een ‘stationspark’.[n][n]Een verbinding tussen het landelijk gebied, de nieuwe woonwijk en het station, kan worden gelegd door een nieuwe fietsbrug. De gemeente ontwerpt deze brug bij voorkeur integraal met het verplaatsen van de halte voor de Q-liner naar Leeuwarden en het verbreden van de N242.', 'Op station Heerhugowaard stoppen Intercity’s naar Den Helder, Nijmegen, Maastricht, Haarlem en Hoorn. Er is overstap mogelijk op 2 buslijnen.[n][n]Door de afstand tussen station en ziekenhuis is verplaatsing van het station ooit ter sprake gekomen, maar dit is te ingrijpend. De huidige economische dragers liggen rondom het huidige station en er is fysiek ook geen ruimte voor verplaatsing. Er komt daarom een goede buslijn naar het ziekenhuis. De spoorse doorsnijding van de Zuidtangent zal een tunnelbak worden. Heerhugowaard wil graag ‘spoortuin’ worden en in het rangeerterrein voor de PHS voorzien. Hierdoor kan Programma Hoogfrequent Spoor worden doorgetrokken tot Heerhugowaard en kan een waardevolle ontwikkellocatie vrijkomen nabij station Alkmaar.', 'Heerhugowaard', 'Alkmaar', 68, 135, 43, 86, 162, 85, 12, 36, 157, 15, 49, 8, 10, 55, 4495, 781, 223075, 181675, 8923, 7267),
(33, 'Hlo', 'Heiloo', '1', NULL, 'De verwachting is dat de toekomstige bewoners van de wijk Zandzoom vooral uit de Amsterdamse regio zullen komen. De aansluiting op de A9 en de komst van Programma Hoogfrequent Spoor is voor die doelgroep van belang. Een andere belangrijke meerwaarde van het gebied is de korte afstand tot het strand. De campings gaan binnenkort weg, daar komen woningen voor in de plaats. Het toevoegen van banen is gewenst. Op dit moment komen deze nieuwe banen vooral in Boekelermeer en niet binnen stationsgebied. Een goede busverbinding Alkmaar-Boekelermeer-Heiloo zou daarom handig zijn.[n][n]Er is ooit gesproken over een extra station bij Zandzoom, of verplaatsing van het huidige station. Beide zijn nu niet aan de orde. De nieuwe ontwikkeling van Zandzoom wordt nu met een busverbinding aangetakt op het openbaar vervoer netwerk. Deze busverbinding sluit niet aan op station Heiloo. De verwachting is dat mensen vanuit Zandzoom vooral met de fiets naar het station zullen gaan.', 'Op station Heiloo stoppen Intercity’s naar Den Helder, Maastricht, Haarlem en Hoorn. Er kan worden overgestapt op 1 buslijn.[n][n]Heiloo is een echte forenzengemeente. De wens is daarom om het station een intercitystation te laten blijven. Er gaat een buurtbus van het station naar het strand en er zijn ov-fiets boxen.  Heiloo mag een aantakking op de A9 maken. Dit biedt de mogelijkheid om de wegenstructuur van Heiloo anders in te richten waardoor de afwikkeling van het verkeer beter verloopt. De wens is om bij de Vennewatersweg een tunnel onder het spoor te maken, waar het doorgaande verkeer vanuit de westzijde over afgewikkeld kan worden.', 'Heiloo', 'Alkmaar', 14, 200, 44, 27, 289, 13, 13, 20, 118, 4, 4, 1, 2, 41, 6765, 50, 103625, 28975, 4145, 1159),
(34, 'Kbw', 'Koog - Bloemwijk', '1', NULL, 'Koog-Bloemwijk is een stationnetje dat mooi in de wijk ligt. Er zijn geen plannen om daar iets aan te veranderen.', 'Op station Koog-Bloemwijk stoppen Sprinters naar Uitgeest, Amsterdam en Rotterdam. Er kan worden overgestapt op 1 buslijn.', 'Zaanstad', 'Stadsregio Amsterdam', 54, 355, 64, 16, 163, 4, 2, 35, 93, 2, 1, 1, 0, 0, 6169, 8, 57950, 3550, 2318, 142),
(35, 'Kzd', 'Koog - Zaandijk', '1', NULL, 'Koog-Zaandijk is voor de gemeente het volgende knooppunt dat verder ontwikkeld kan worden. Het gaat dan om verbeteren van de toegankelijkheid en toevoegen van woon- en werkprogramma. Er ligt grond waar programma ontwikkeld kan worden. Door het spoor- en weglawaai is deze plek niet heel geschikt voor woningen, maar leisure zou hier heel goed passen. Zeker in combinatie met de Zaanse Schans, die binnen het stationsgebied valt, is deze plek verder te ontwikkelen tot een recreatieve knoop.[n][n]Ook kan er op termijn ruimte vrijkomen langs de oevers van de Zaan, voor ontwikkeling van ZaanIJ. Hier zijn nu goed lopende bedrijven gevestigd met een groot milieubeslag, terwijl er fantastische woonmilieus langs het water gerealiseerd kunnen worden als de hindercontouren wegvallen. Als knooppuntontwikkeling wat meer in trek komt, kan hieraan worden begonnen.', 'Station Koog-Zaandijk is goed bereikbaar, zowel met de auto als met de trein. Er stoppen Sprinters naar Uitgeest, Amsterdam en Rotterdam. Er kan worden overgestapt op 1 buslijn. Tegelijk met de ruimtelijke ontwikkeling van Koog-Zaandijk zullen de gelijkvloerse kruisingen moeten worden aangepakt, waarbij provinciale financiering nodig is.', 'Zaanstad', 'Stadsregio Amsterdam', 54, 368, 42, 37, 122, 30, 9, 37, 147, 3, 16, 1, 1, 22, 4646, 63, 98000, 26650, 3920, 1062),
(36, 'Kma', 'Krommenie - Assendelft', '1', NULL, 'Rond station Krommenie-Assendelft is voornamelijk gefocust op woningbouw, zowel gestapeld als grondgebonden. Een groot deel hiervan is al gerealiseerd. Tegelijkertijd is ook het station een stuk naar het westen verplaatst, waardoor het beter is aangesloten op de omliggende infrastructuur. Ander programma, zoals kantoren, komt hier moeilijk van de grond, hoewel er ruimtelijke mogelijkheden voor zijn.', 'Samen met Zaandam is Krommenie-Assendelft een belangrijk knooppunt van de gemeente Zaanstad. Op het station stoppen Sprinters naar Uitgeest, Rotterdam en Amsterdam. Er kan worden overgestapt op 4 buslijnen.[n][n]Veel mensen komen hier met de fiets naar het station. Het is lastig om voldoende fietsenstallingen bij te bouwen.', 'Zaanstad', 'Stadsregio Amsterdam', 59, 205, 53, 22, 188, 43, 7, 129, 80, 4, 0, 2, 5, 57, 8462, 41, 105250, 2000, 4210, 80),
(37, 'Utg', 'Uitgeest', 'TOD_optimalisatie', '', 'Er is recentelijk een nieuw stationsgebouw met P+R voorziening aangelegd en daarmee ziet de gemeente het knooppunt nu als af. De parkeerdruk wordt als een last gezien, maar er is gebrek aan ruimte en geld om het parkeren uit te breiden.[n][n]In de structuurvisie Uitgeest 2020 is de belangrijkste ambitie het realiseren van 500 woningen. Daarmee zal Uitgeest groeien naar 14.000 inwoners, wat het nodig heeft om zelfstandig te blijven. Uitgeest wil om die reden ook de groene buffer handhaven richting Heemskerk. De gemeente heeft inbreidingslocaties en een uitleggebied aan de noordzijde van Uitgeest op het oog. Het stationsgebied speelt hierin geen rol.[n][n]Er was in het verleden sprake van een Rode Kruis ziekenhuis dat nabij het station gerealiseerd zou kunnen worden.Voorlopig komt dat er niet, maar de gemeente staat positief tegenover een dergelijke ontwikkeling.', 'Op station Uitgeest stoppen Intercity’s naar Haarlem en Hoorn, en Sprinters naar Amsterdam en Rotterdam. Er kan worden overgestapt op 2 buslijnen.[n][n]Uitgeest is een succesvolle P+R locatie, goed gelegen bij de splitsing van 2 spoorlijnen en nabij de snelweg. De frequentieverhoging op de Zaancorridor in het kader van PHS biedt kansen voor station Uitgeest. De nu al goede bereikbaarheid van dit station zal alleen nog maar verder toenemen.', 'Uitgeest', 'Zuid-Kennemerland', 90, 333, 25, 12, 137, 2, 1, 59, 253, 3, 0, 0, 0, 136, 4418, 127, 30950, 2325, 1238, 93),
(38, 'Wm', 'Wormerveer', '1', '', 'Station Wormerveer heeft in de gemeente geen prioriteit wat betreft knooppuntontwikkeling. Dit komt voornamelijk door het natuurgebied dat direct aan het station grenst. Het natuurgebied is niet toegankelijk. Het stationsgebied zelf wordt nu wel door ProRail onderhanden genomen. Er is weinig ruimte om nog iets rondom dit station toe te voegen. Het station wordt wel veel gebruikt door de inwoners van de gemeente Wormerland, gelegen ten noorden van de Zaan. Wormerveer heeft last van vergrijzing.', 'Op station Wormerveer stoppen Sprinters naar Uitgeest, Amsterdam en Rotterdam. Er kan worden overgestapt op 4 buslijnen.', 'Zaanstad', 'Stadsregio Amsterdam', 58, 168, 39, 44, 131, 42, 3, 22, 250, 9, 1, 1, 3, 0, 5217, 347, 131775, 4975, 5271, 199),
(39, 'Zd', 'Zaandam', '1', '', 'De nabijheid van Amsterdam is een belangrijke kwaliteit van het stationsgebied van Zaandam. Binnen 6 minuten ben je op Amsterdam Sloterdijk en binnen 12 minuten op Amsterdam Centraal. Rondom het station speelt de ontwikkeling van Inverdan, een combinatie van wonen, werken en leisure. Het stationsgebied kreeg snel bekendheid door de opvallende architectuur, refererend aan Zaanse huisjes. Het gemeentehuis bevindt zich nabij de knoop. Er zijn al 4.000 woningen binnenstedelijk bijgebouwd. De gemeente onderzoekt momenteel of het geplande kantoorprogramma eventueel kan worden omgezet naar wonen.', 'Op station Zaandam stoppen Intercity’s naar Den Helder, Maastricht en Nijmegen, en Sprinters naar Hoofddorp, Uitgeest, Rotterdam en Amsterdam. Er kan worden overgestapt op HOV-bussen richting Amsterdam en op 9 andere buslijnen. Er is een nieuwe parkeergarage in het gebied aangelegd met 900 parkeerplekken.', 'Zaanstad', 'Stadsregio Amsterdam', 192, 205, 70, 74, 167, 101, 12, 48, 113, 6, 15, 2, 9, 4, 7672, 267, 326475, 42150, 13059, 1686),
(40, 'Bv', 'Beverwijk', 'TOD_optimalisatie', '', 'Station Beverwijk is het knooppunt voor de Noordelijke IJmondregio, zowel voor winkelend publiek als bijvoorbeeld de bioscoop (waar je na 6-en gratis kunt parkeren). Het is het winkelgebied van de regio. De ontwikkeling Meerplein en de herontwikkeling van de Beverhof zullen deze functie verder versterken. De relatie tussen station en centrum zal wel verbeterd moeten worden, want op dit moment is er geen duidelijke route. [n][n]De Bazaar is een grootschalige voorziening, met 50.000 bezoekers per weekend. Hemelsbreed ligt deze trekker op 1000 mjeter afstand van het station. Het aantrekkelijker maken van de route naar de Bazaar kan bezoekers stimuleren om de trein te nemen. Nu komt het overgrote deel nog met de auto, het parkeren kost slechts 3 euro per dag. ', 'Op station Beverwijk stoppen Intercity’s naar Haarlem en Hoorn, en Sprinters naar Amsterdam en Uitgeest. Het station functioneert als de overstapknoop voor de regio. 5 verschillende buslijnen stoppen bij dit station. [n][n]De A22 vormt samen met het spoor een grote barrière tussen het centrum van Beverwijk en het bedrijventerrein de Pijp met de Bazaar aan de oostzijde. Er zou een nieuw viaduct kunnen komen dat een alternatief biedt voor snelverkeer. De huidige doorgang kan dan gebruikt worden om de relatie tussen het centrum en de haven te versterken. [n][n]Het P+R terrein bij het station wordt (nog) niet goed gebruikt, onder andere door veel ander parkeeraanbod in de omgeving en onbekendheid van het terrein. [n][n]Alle fietsen op maaiveld zullen worden ondergebracht in een verdiepte fietsenkelder. De totale stallingscapaciteit rondom het station zal dan 2400/2500 fietsen worden.', 'Beverwijk en Velsen', 'Zuid-Kennemerland', 63, 350, 59, 69, 167, 94, 29, 53, 110, 15, 58, 7, 7, 20, 6867, 526, 272513, 71575, 10901, 2863),
(41, 'Bll', 'Bloemendaal', 'TOD_optimalisatie', '', 'Station Bloemendaal is tegelijk ook station Haarlem Noord. De gemeentegrens ligt namelijk op het spoor. Het station is gericht op Bloemendaal maar zou veel meer twee-zijdig moeten worden. Vanuit de Haarlemse zijde is het station slecht te bereiken. Inwoners en werknemers aan deze kant van het station zullen nu eerder de bus of de fiets nemen naar station Haarlem dan dat zij gebruik maken van station Bloemendaal. Op verzoek van Haarlem is station Bloemendaal nu een uitvoeringsproject in de structuurvisie van Bloemendaal geworden. De mogelijkheid voor een transferium wordt onderzocht. [n][n]In het kader van het toegankelijkheidsprogramma van Prorail krijgt Bloemendaal liften op het station.', 'Op station Bloemendaal stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er is geen busverbinding aanwezig. Het verbinden van twee wegen onder het spoor door zou, naast het verbeteren van de bereikbaarheid van het station, het mogelijk kunnen maken om een rendabele bus te laten rijden. ', 'Bloemendaal en Haarlem', 'Zuid-Kennemerland', 19, 80, 35, 30, 232, 0, 6, 23, 111, 3, 0, 0, 0, 35, 4321, 185, 75263, 4088, 3011, 164),
(42, 'Drh', 'Driehuis', 'TOD_optimalisatie', '', 'Van de drie stations binnen de gemeente Velsen kan station Driehuis, dankzij haar multimodale bereikbaarheid en de komst van de HOV-Velsen, zich wellicht het beste als knooppunt ontwikkelen. Op dit moment heeft Driehuis een middelbare school (Ichtus) en het crematorium/begraafplaats Westerveld dat bezoekers trekt, ook met de trein. [n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Driehuis stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station. [n][n]De plannen voor een HOV-verbinding van Haarlem naar IJmuiden strand langs station Driehuis geven nieuwe mogelijkheden voor het stationsgebied. Doordat de HOV-halte en het station in de huidige plannen echter niet met elkaar verknoopt zijn zullen deze twee modaliteiten elkaar niet gaan versterken, maar juist gaan beconcurreren. ', 'Velsen', 'Zuid-Kennemerland', 19, 345, 3, 68, 84, 9, 7, 48, 214, 3, 0, 3, 0, 87, 171, 114, 14363, 11263, 575, 451),
(43, 'Hlm', 'Haarlem', 'TOD_optimalisatie', '', 'Het stationsgebied van Haarlem kenmerkt zich door stedelijke levendigheid. Het is een gemengd milieu met wonen, winkels, kleinschalige bedrijvigheid en kantoren. De historische binnenstad van Haarlem wordt door het station direct ontsloten.[n][n]De spoorwegdriehoek is een afgesloten gebied tussen de drie spoorlijnen. De lange termijn ambitie is om belangrijke delen van de Spoorwegdriehoek en omgeving te integreren in de stad. Het ruimtebeslag van het rangeerterrein en het goederenspoor zal daarvoor mkoeten veranderen. Ook moeten de problemen van geluidshinder, bodemverontreiniging en externe veiligheid opgelost worden.', 'Op station Haarlem stoppen intercity’s naar Amsterdam, Den Haag/Rotterdam en Hoorn.Er is overstap mogelijk op 14 verschillende buslijnen. Daarnaast is station Haarlem het eindpunt van de succesvolle, hoogfrequente Zuidtangent, een HOV-busverbinding via Hoofddorp en Schiphol naar Amsterdam Bijlmer-Arena. [n][n]Als multimodaal knooppunt is Haarlem CS minder geschikt door de slechte bereikbaarheid per auto.\r\n', 'Haarlem', 'Zuid-Kennemerland', 320, 160, 127, 54, 241, 26, 24, 74, 43, 10, 20, 4, 13, 0, 14614, 331, 457338, 27638, 18294, 1106),
(44, 'Hlms', 'Haarlem &shy;Spaarnwoude', 'TOD_optimalisatie', '', 'Rondom het station Haarlem Spaarnwoude liggen veel potentiele ontwikkellocaties. Daarnaast ligt de grootste transformatieopgave van Haarlem in het oostelijk deel van de stad. [n][n]De omgeving van station Spaarnwoude is ruim van opzet. Er is nog ruimte beschikbaar voor de vestiging van nieuwe functies. Het hele gebied bezit nog een aanzienlijke, onbenutte potentie om tot ontwikkeling te komen. Doordat dit stationsgebied direct bereikbaar is met zowel trein als auto en strategisch gelegen is tussen Haarlem en Amsterdam, ligt het voor de hand een intensievere, meer stedelijke ontwikkeling voor te stellen. Zo kan dit stationsgebied gaan functioneren als entree naar de stad. [n][n]De ligging van het station vlakbij het recreatiegebied de Veerplas (ruim 900.000 bezoeker per jaar) geeft dit station ook een interessante recreatieve potentie als Buitenpoort.', 'Op station Haarlem-Spaarnwoude stoppen Sprinters naar Amsterdam en Haarlem (4x per uur) en Zandvoort en Uitgeest (2x per uur).  Er kan worden overgestapt op 2 buslijnen. Haarlem Spaarnwoude kan zich heel goed verder ontwikkelen tot een multimodaal knooppunt wanneer het nog beter wordt aangesloten op onderliggend ov, voldoende P+R capaciteit bezit en daarnaast goed te bereiken is met de fiets.', 'Haarlem', 'Zuid-Kennemerland', 76, 368, 42, 95, 79, 98, 4, 42, 227, 10, 50, 0, 2, 64, 4215, 561, 229900, 102463, 9196, 4099),
(45, 'Hwzb', 'Halfweg-&shy;Zwanenburg', 'TOD_optimalisatie', '', 'Het station Halfweg-Zwanenburg heeft twee gezichten: Noord en Zuid. De grootste ontwikkeling bevindt zich aan de zuidzijde, genaamd Sugar City. Het gaat om de transformatie van de oude suikerfabriek naar gemengde functies: een factory outlet, een hotel met 400 kamers, winkels, kantoren, etc. Dit zal veel nieuwe werknemers en bezoekers opleveren. [n][n]Recreatiegebied Houtrak aan de noordzijde van het station trekt ongeveer 1.000.000 bezoekers per jaar. Er bevindt zich hier ook een festivalterrein voor ongeveer 10.000 bezoekers. Vanaf het station kun je lopend naar het recreatiegebied en het festivalterrein. Het station heeft daarom veel potentie om zich verder te ontwikkelen als Buitenpoort\r\nHet dorp Halfweg blijft dorps met kleine dorpse ontwikkelingen. Complicerende factor is de geluidszone van de haven die verruimd moet worden om de haven te laten groeien. De bewoners hebben op dit moment al heel veel geluidsoverlast van de N-weg, met veel vrachtverkeer vanuit de haven, het spoor en het vliegverkeer.', 'Op station Halfweg-Zwanenburg stoppen Sprinters naar Amsterdam en Haarlem (4x per uur), Zandvoort en Uitgeest (2x per uur). Er kan worden overgestapt op 2 buslijnen.', 'Haarlemmerliede en Haarlemmermeer', '', 54, 318, 24, 35, 129, 49, 1, 45, 229, 2, 44, 0, 5, 7, 3544, 155, 72150, 37900, 2886, 1516),
(46, 'Hk', 'Heemskerk', 'TOD_optimalisatie', '', 'Dankzij de realisatie van Broekpolder (ca. 3550 woningen) is station Heemskerk midden in het dorp komen te liggen. Het stationsgebied is daarom interessanter geworden voor verdere ontwikkeling. Bij de gemeente is de wens en ambitie aanwezig om station Heemskerk als knooppunt sterk te verbeteren en te veranderen. [n][n]De directe stationsomgeving is een toekomstige ontwikkellocatie waar diverse programmatische ideeën over zijn zoals een middelbare school, woningbouw of een kantoorlocatie. Er liggen wel veel belemmeringen op dit gebied, onder andere lawaai, vreemd eigendom en een persleiding. ', 'Op station Heemskerk stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station. Doordat het station nu niet bereikbaar is met onderliggend openbaar vervoer maken mensen vaak gebruik maken van station Uitgeest, Castricum of Beverwijk, die alle drie beter zijn aangesloten met busverbindingen en ook meer treinaansluitingen hebben. [n][n]Sinds de realisatie van Broekpolder zijn er te weinig fietsenstallingen rondom het station.', 'Heemskerk en Beverwijk', 'Zuid-Kennemerland', 19, 200, 46, 9, 172, 3, 5, 127, 145, 1, 0, 0, 1, 19, 8250, 106, 43975, 2513, 1759, 101),
(47, 'Had', 'Heemstede-Aerdenhout', 'TOD_optimalisatie', '', 'Heemstede is een echte forensengemeente: in de ochtend vertrekt iedereen naar zijn werk, in de avond komen ze allemaal weer terug. De rest van de dag is het rustig op het station.[n][n]Deze regio levert een hoop hoogopgeleide arbeidskrachten aan Amsterdam, Schiphol en Den Haag. Dat is volgens de gemeente ook de reden dat er Intercity’s stoppen op dit station, ondanks dat het zo dicht bij station Haarlem ligt.', 'Op station Heemstede-Aerdenhout stoppen Intercity’s naar Amsterdam, Den Haag en Rotterdam, en Sprinters naar Haarlem en Den Haag. De verwachting en wens van de gemeente is dat de Intercity-status van het station niet zal gaan veranderen. Er kan worden overgestapt op een aantal verschillende buslijnen. [n][n]Het gros van de reizigers komt echter met de fiets naar het station. De fietsenrekken staan altijd helemaal vol. Het station bedient de gemeentes Heemstede, Aerdenhout en Haarlem-Zuid en deze afstanden zijn goed met de fiets af te leggen. Daarnaast wordt er veel gebruik gemaakt van kiss & ride. Er is geen busverbinding van oost naar west, maar hier is volgens de gemeente ook geen vraag naar. ', 'Heemstede, Bloemendaal en Haarlem', '', 77, 153, 41, 26, 289, 11, 9, 26, 117, 4, 0, 0, 0, 18, 6375, 146, 94888, 5788, 3796, 232),
(48, 'Ovn', 'Overveen', 'TOD_optimalisatie', '', 'De meeste reizigers op station Overveen zijn studenten van het ROC. Desondanks worden er geen plannen gemaakt voor bijvoorbeeld studentenvoorzieningen.  De gemeente Haarlem zou het station graag meer willlen verschuiven richting het ROC, maar voor de gemeente Bloemendaal is het juist goed dat de studenten nu via de winkelstraat van Overveen naar het station lopen. [n][n]Er is wel eens nagedacht of Overveen niet station Kennemerduinen moest gaan heten. Dankzij haar ligging vlakbij dit Nationale Park zou Overveen ook kunnen functioneren als een recreatief knooppunt.', 'Op station Overveen stopt de Sprinter naar Zandvoort en Haarlem, Amsterdam. Er is geen busverbinding aanwezig. Er zijn wel een aantal ideeën om Overveen beter op het onderliggend openbaarvervoersnetwerk aan te sluiten. Zo zou er een bus kunnen rijden tussen Overveen en Bloemendaal. Wanneer deze goed aansluit op de dienstregeling ontstaat er een soort kwartierservice. Daarnaast rijdt spitsbus 8 nu langs het station zonder daar te stoppen. Als laatste zou er een strandbus vanaf Overveen naar Bloemendaal kunnen rijden.', 'Bloemendaal en Haarlem', 'Zuid-Kennemerland', 26, 115, 30, 47, 141, 5, 13, 27, 244, 8, 1, 5, 1, 45, 3849, 312, 103450, 20863, 4138, 835),
(49, 'Sptn', 'Santpoort &shy;Noord', 'TOD_optimalisatie', '', 'Santpoort Noord kan ontwikkeld worden als recreatief knooppunt, een Buitenpoort. Het station is hier heel geschikt voor dankzij haar directe ligging aan de Kennemerduinen. Er zijn al wat wandelroutes aanwezig, maar de recreatieve potentie kan nog veel verder uitgebreid worden. [n][n]De kansen liggen voor het oprapen: verbeteren van voorzieningen zoals fietsverhuur en horeca of een bezoekerscentrum en het duidelijk aangeven van wandel- en fietsroutes. Ook een aantrekkelijke en duidelijke entree van het station naar de Kennemerduinen is belangrijk. Dit vraagt om een impuls van de openbare ruimte en het aanpakken van de onaantrekkelijke tunnel. [n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Santpoort Noord stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er stoppen geen bussen bij het station. [n][n]De plannen voor een HOV-verbinding van Haarlem naar IJmuiden strand door de dorpskern van Santpoort Noord zullen de positie van het station niet verbeteren. De HOV-halte ligt straks centraal in het dorp, en er zal minimaal 6x  per uur een snelle bus stoppen. Dit maakt de hoogfrequente bus tot een zeer aantrekkelijk alternatief op de trein.', 'Velsen', 'Zuid-Kennemerland', 19, 245, 3, 74, 73, 2, 5, 18, 211, 2, 0, 1, 0, 11, 182, 62, 14125, 900, 565, 36),
(50, 'Sptz', 'Santpoort &shy;Zuid', 'TOD_optimalisatie', '', 'Santpoort Zuid kan ontwikkeld worden als recreatief knooppunt, hoewel de positie van Santpoort Noord, direct aan de Kennemerduinen, hier wellicht meer kansen voor biedt.[n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Santpoort Zuid stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station.', 'Velsen, Bloemendaal en Haarlem', '', 19, 120, 25, 11, 143, 0, 19, 19, 174, 17, 0, 6, 0, 75, 3537, 487, 21763, 5188, 871, 208),
(51, 'Vgbb', 'Vogelenzang-&shy;Bennebroek', 'TOD_optimalisatie', '', 'Het heropenen van station Vogelenzang Bennebroek is in de structuurvisie van gemeente Bloemendaal als uitvoeringsproject opgenomen. Het is een bestaand station dat in de jaren ’50 is gesloten. Er is sprake van een uitbreiding van het dorp Vogelenzang aan de westzijde van het station. Daarnaast ligt het psychiatrisch ziekenhuis, het dorp Bennebroek, en de Linnaeshof (300.000 bezoekers per jaar), binnen de eventuele invloedssfeer van dit nieuwe station. Vanaf dit station zou ook een recreatieve verbinding mket het strand gemaakt kunnen worden [n][n]Al deze elementen in combinatie met de mogelijke Westflank-ontwikkeling van Haarlemmermeer geeft voldoende aanleiding om heropening van dit nieuwe station serieus te overwegen.', 'In de toekomst zal de bus niet meer gaan stoppen in Vogelenzang waardoor dit dorp straks zonder openbaar vervoer komt te zitten. Opening van station Vogelenzang-Bennebroek kan hier verandering in aanbrengen. In dat geval zal op dit station in ieder geval de sprinter tussen Haarlem en Den Haag gaan stoppen.', 'Heemstede, Bennebroek en Bloemendaal', '', 0, 115, 19, 42, 124, 8, 26, 23, 272, 0, 0, 0, 0, 65, 2588, 53, 61950, 50, 2478, 2),
(52, 'Wg', 'Haarlem-&shy;Westergracht', 'TOD_optimalisatie', '', 'Het station Westergracht is een mogelijk nieuw te openen station. De kansen hiervoor kunnen worden onderzocht. Er zijn veel potentiele reizigers in het stationsgebied. Maar de nabijheid van Haarlem CS en Heemstede Aerdenhout, beide intercity stations, maakt dat de potentiele reizigers wellicht toch eerder voor een van deze stations zullen kiezen', 'Als het station Westergracht zou worden geopend zal hier in ieder geval de sprinter tussen Haarlem en Den Haag gaan stoppen.', 'Haarlem', 'Zuid-Kennemerland', 0, 105, 94, 39, 144, 11, 7, 18, 66, 2, 2, 1, 0, 23, 7283, 147, 161850, 13988, 6474, 560),
(53, 'Hlm1', 'Haarlem (bau)', 'Business as usual', '', 'Het stationsgebied van Haarlem kenmerkt zich door stedelijke levendigheid. Het is een gemengd milieu met wonen, winkels, kleinschalige bedrijvigheid en kantoren. De historische binnenstad van Haarlem wordt door het station direct ontsloten.[n][n]De spoorwegdriehoek is een afgesloten gebied tussen de drie spoorlijnen. De lange termijn ambitie is om belangrijke delen van de Spoorwegdriehoek en omgeving te integreren in de stad. Het ruimtebeslag van het rangeerterrein en het goederenspoor zal daarvoor moeten veranderen. Ook moeten de problemen van geluidshinder, bodemverontreiniging en externe veiligheid opgelost worden.', 'Op station Haarlem stoppen intercity’s naar Amsterdam, Den Haag/Rotterdam en Hoorn.Er is overstap mogelijk op 14 verschillende buslijnen. Daarnaast is station Haarlem het eindpunt van de succesvolle, hoogfrequente Zuidtangent, een HOV-busverbinding via Hoofddorp en Schiphol naar Amsterdam Bijlmer-Arena. [n][n]Als multimodaal knooppunt is Haarlem C CS minder geschikt door de slechte bereikbaarheid per auto.', 'Haarlem', 'Zuid-Kennemerland', 320, 160, 127, 54, 241, 26, 24, 74, 43, 10, 2, 4, 12, 0, 14614, 0, 457338, 0, 18294, 0),
(54, 'Zvt', 'Zandvoort &shy;aan Zee', 'TOD_optimalisatie', '', 'Zandvoort is de enige badplaats in Nederland met een station zo dicht bij het strand. Er zijn diverse plannen gemaakt om, door vernieuwing van de openbare ruimte en het toevoegen van aansprekend programma, de allure van Zandvoort te verbeteren. [n][n]Het belangrijkste is dat het stationsgebied van Zandvoort wordt gekoppeld aan de ontwikkellocatie langs de kust (entree Zandvoort). In dit gebied zijn onder andere horeca, retail en een hotel gepland. Het entreegebied van het station naar het strand zal sterk verbeterd worden zodat Zandvoort dé badplaats van de Metropoolregio Amsterdam kan worden. Tegelijkertijd zal de openbare ruimte ook een facelift moeten krijgen. De boulevard, die de twee belangrijkste ontwikkellocaties verbindt, zal vernieuwd worden. [n][n]De ambitie van de gemeente is om meer jaarrond programma in Zandvoort te krijgen zoals bijvoorbeeld een theater. Daarnaast is er in Zandvoort veel meer te vinden dan alleen de zee. Er is een oude dorpskern en het wordt omgeven door twee grote natuurgebieden, die vanaf het station beter ontsloten zouden moeten worden. ', 'Op station Zandvoort aan Zee stoppen Sprinters naar Haarlem en Amsterdam. Er kan worden overgestapt op 1 buslijn. Het busstation van Zandvoort, waar meer bussen stoppen, ligt op ongeveer 7 minuten lopen van het treinstation. [n][n]Er ligt een R-net concept voor het upgraden van bus 80 (Zandvoort-Adam) naar een HOV-verbinding. Maar bus 75 (HOV-Velsen) zal nu eerst worden ontwikkeld. ', 'Zandvoort', 'Zuid-Kennemerland', 28, 70, 43, 23, 160, 4, 8, 22, 259, 7, 0, 2, 1, 1, 6822, 330, 89400, 14738, 3576, 590),
(55, 'Bv1', 'Beverwijk (bau)', 'Business as usual', '', 'Station Beverwijk is het knooppunt voor de Noordelijke IJmondregio, zowel voor winkelend publiek als bijvoorbeeld de bioscoop (waar je na 6-en gratis kunt parkeren). Het is het winkelgebied van de regio. De ontwikkeling Meerplein en de herontwikkeling van de Beverhof zullen deze functie verder versterken. De relatie tussen station en centrum zal wel verbeterd moeten worden, want op dit moment is er geen duidelijke route. [n][n]De Bazaar is een grootschalige voorziening, met 50.000 bezoekers per weekend. Hemelsbreed ligt deze trekker op 1000 mjeter afstand van het station. Het aantrekkelijker maken van de route naar de Bazaar kan bezoekers stimuleren om de trein te nemen. Nu komt het overgrote deel nog met de auto, het parkeren kost slechts 3 euro per dag. ', 'Op station Beverwijk stoppen Intercity’s naar Haarlem en Hoorn, en Sprinters naar Amsterdam en Uitgeest. Het station functioneert als de overstapknoop voor de regio. 5 verschillende buslijnen stoppen bij dit station. [n][n]De A22 vormt samen met het spoor een grote barrière tussen het centrum van Beverwijk en het bedrijventerrein de Pijp met de Bazaar aan de oostzijde. Er zou een nieuw viaduct kunnen komen dat een alternatief biedt voor snelverkeer. De huidige doorgang kan dan gebruikt worden om de relatie tussen het centrum en de haven te versterken. [n][n]Het P+R terrein bij het station wordt (nog) niet goed gebruikt, onder andere door veel ander parkeeraanbod in de omgeving en onbekendheid van het terrein. [n][n]Alle fietsen op maaiveld zullen worden ondergebracht in een verdiepte fietsenkelder. De totale stallingscapaciteit rondom het station zal dan 2400/2500 fietsen worden.\r\n', 'Beverwijk en Velsen', 'Zuid-Kennemerland', 63, 350, 59, 69, 167, 94, 29, 53, 110, 10, 2, 2, 5, 4, 6867, 516, 272513, 12188, 10901, 488),
(56, 'Bll1', 'Bloemendaal (bau)', 'Business as usual', '', 'Station Bloemendaal is tegelijk ook station Haarlem Noord. De gemeentegrens ligt namelijk op het spoor. Het station is gericht op Bloemendaal maar zou veel meer twee-zijdig moeten worden. Vanuit de Haarlemse zijde is het station slecht te bereiken. Inwoners en werknemers aan deze kant van het station zullen nu eerder de bus of de fiets nemen naar station Haarlem dan dat zij gebruik maken van station Bloemendaal. Op verzoek van Haarlem is station Bloemendaal nu een uitvoeringsproject in de structuurvisie van Bloemendaal geworden. De mogelijkheid voor een transferium wordt onderzocht. [n][n]In het kader van het toegankelijkheidsprogramma van Prorail krijgt Bloemendaal liften op het station.', 'Op station Bloemendaal stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er is geen busverbinding aanwezig. Het verbinden van twee wegen onder het spoor door zou, naast het verbeteren van de bereikbaarheid van het station, het mogelijk kunnen maken om een rendabele bus te laten rijden. ', 'Bloemendaal en Haarlem', 'Zuid-Kennemerland', 19, 80, 35, 30, 232, 0, 6, 23, 111, 3, 0, 0, 0, 2, 4321, 90, 75263, 2513, 3011, 101),
(57, 'Drh1', 'Driehuis (bau)', 'Business as usual', '', 'Van de drie stations binnen de gemeente Velsen kan station Driehuis, dankzij haar multimodale bereikbaarheid en de komst van de HOV-Velsen, zich wellicht het beste als knooppunt ontwikkelen. Op dit moment heeft Driehuis een middelbare school (Ichtus) en het crematorium/begraafplaats Westerveld dat bezoekers trekt, ook met de trein. [n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Driehuis stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station. [n][n]De plannen voor een HOV-verbinding van Haarlem naar IJmuiden strand langs station Driehuis geven nieuwe mogelijkheden voor het stationsgebied. Doordat de HOV-halte en het station in de huidige plannen echter niet met elkaar verknoopt zijn zullen deze twee modaliteiten elkaar niet gaan versterken, maar juist gaan beconcurreren. ', 'Velsen', 'Zuid-Kennemerland', 19, 345, 3, 68, 84, 9, 7, 48, 214, 2, 0, 2, 0, 5, 171, 63, 14363, 10488, 575, 420),
(58, 'Hlms1', 'Haarlem &shy;Spaarnwoude (bau)', 'Business as usual', '', 'Rondom het station Haarlem Spaarnwoude liggen veel potentiele ontwikkellocaties. Daarnaast ligt de grootste transformatieopgave van Haarlem in het oostelijk deel van de stad. [n][n]De omgeving van station Spaarnwoude is ruim van opzet. Er is nog ruimte beschikbaar voor de vestiging van nieuwe functies. Het hele gebied bezit nog een aanzienlijke, onbenutte potentie om tot ontwikkeling te komen. Doordat dit stationsgebied direct bereikbaar is met zowel trein als auto en strategisch gelegen is tussen Haarlem en Amsterdam, ligt het voor de hand een intensievere, meer stedelijke ontwikkeling voor te stellen. Zo kan dit stationsgebied gaan functioneren als entree naar de stad. [n][n]De ligging van het station vlakbij het recreatiegebied de Veerplas (ruim 900.000 bezoeker per jaar) geeft dit station ook een interessante recreatieve potentie als Buitenpoort.', 'Op station Haarlem-Spaarnwoude stoppen Sprinters naar Amsterdam en Haarlem (4x per uur) en Zandvoort en Uitgeest (2x per uur).  Er kan worden overgestapt op 2 buslijnen. Haarlem Spaarnwoude kan zich heel goed verder ontwikkelen tot een multimodaal knooppunt wanneer het nog beter wordt aangesloten op onderliggend ov, voldoende P+R capaciteit bezit en daarnaast goed te bereiken is met de fiets.', 'Haarlem', 'Zuid-Kennemerland', 76, 368, 42, 95, 79, 98, 4, 42, 227, 10, 10, 0, 2, 7, 4215, 458, 229900, 14013, 9196, 561),
(59, 'Hwzb1', 'Halfweg-Zwanenburg (bau)', 'Business as usual', '', 'Het station Halfweg-Zwanenburg heeft twee gezichten: Noord en Zuid. De grootste ontwikkeling bevindt zich aan de zuidzijde, genaamd Sugar City. Het gaat om de transformatie van de oude suikerfabriek naar gemengde functies: een factory outlet, een hotel met 400 kamers, winkels, kantoren, etc. Dit zal veel nieuwe werknemers en bezoekers opleveren. [n][n]Recreatiegebied Houtrak aan de noordzijde van het station trekt ongeveer 1.000.000 bezoekers per jaar. Er bevindt zich hier ook een festivalterrein voor ongeveer 10.000 bezoekers. Vanaf het station kun je lopend naar het recreatiegebied en het festivalterrein. Het station heeft daarom veel potentie om zich verder te ontwikkelen als Buitenpoort\r\nHet dorp Halfweg blijft dorps met kleine dorpse ontwikkelingen. Complicerende factor is de geluidszone van de haven die verruimd moet worden om de haven te laten groeien. De bewoners hebben op dit moment al heel veel geluidsoverlast van de N-weg, met veel vrachtverkeer vanuit de haven, het spoor en het vliegverkeer.', 'Op station Halfweg-Zwanenburg stoppen Sprinters naar Amsterdam en Haarlem (4x per uur), Zandvoort en Uitgeest (2x per uur). Er kan worden overgestapt op 2 buslijnen.', 'Haarlemmerliede, Spaarnwoude en Haarlemmermeer', 'Zuid-Kennemerland', 54, 318, 24, 35, 129, 49, 1, 45, 229, 2, 14, 0, 1, 6, 3544, 54, 72150, 2450, 2886, 98),
(60, 'Hk1', 'Heemskerk (bau)', 'Business as usual', '', 'Dankzij de realisatie van Broekpolder (ca. 3550 woningen) is station Heemskerk midden in het dorp komen te liggen. Het stationsgebied is daarom interessanter geworden voor verdere ontwikkeling. Bij de gemeente is de wens en ambitie aanwezig om station Heemskerk als knooppunt sterk te verbeteren en te veranderen. [n][n]De directe stationsomgeving is een toekomstige ontwikkellocatie waar diverse programmatische ideeën over zijn zoals een middelbare school, woningbouw of een kantoorlocatie. Er liggen wel veel belemmeringen op dit gebied, onder andere lawaai, vreemd eigendom en een persleiding. ', 'Op station Heemskerk stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station. Doordat het station nu niet bereikbaar is met onderliggend openbaar vervoer maken mensen vaak gebruik maken van station Uitgeest, Castricum of Beverwijk, die alle drie beter zijn aangesloten met busverbindingen en ook meer treinaansluitingen hebben. [n][n] Sinds de realisatie van Broekpolder zijn er te weinig fietsenstallingen rondom het station.', 'Heemskerk en Beverwijk', 'Zuid-Kennemerland', 19, 200, 46, 9, 172, 3, 5, 127, 145, 2, 0, 0, 1, 2, 8250, 0, 43975, 0, 1759, 0),
(61, 'Had1', 'Heemstede-Aerdenhout (bau)', 'Business as usual', '', '', '', 'Heemstede, Bloemendaal en Haarlem', 'Zuid-Kennemerland', 77, 153, 41, 26, 289, 11, 9, 26, 117, 4, 0, 0, 0, 7, 6375, 125, 94888, 5613, 3796, 225),
(62, 'Ovn1', 'Overveen (bau)', 'Business as usual', '', 'De meeste reizigers op station Overveen zijn studenten van het ROC. Desondanks worden er geen plannen gemaakt voor bijvoorbeeld studentenvoorzieningen.  De gemeente Haarlem zou het station graag meer willlen verschuiven richting het ROC, maar voor de gemeente Bloemendaal is het juist goed dat de studenten nu via de winkelstraat van Overveen naar het station lopen. [n][n]Er is wel eens nagedacht of Overveen niet station Kennemerduinen moest gaan heten. Dankzij haar ligging vlakbij dit Nationale Park zou Overveen ook kunnen functioneren als een recreatief knooppunt.', 'Op station Overveen stopt de Sprinter naar Zandvoort en Haarlem, Amsterdam. Er is geen busverbinding aanwezig. Er zijn wel een aantal ideeën om Overveen beter op het onderliggend openbaarvervoersnetwerk aan te sluiten. Zo zou er een bus kunnen rijden tussen Overveen en Bloemendaal. Wanneer deze goed aansluit op de dienstregeling ontstaat er een soort kwartierservice. Daarnaast rijdt spitsbus 8 nu langs het station zonder daar te stoppen. Als laatste zou er een strandbus vanaf Overveen naar Bloemendaal kunnen rijden.', 'Bloemendaal en Haarlem', 'Zuid-Kennemerland', 26, 115, 30, 47, 141, 5, 13, 27, 244, 8, 1, 5, 1, 7, 3849, 190, 103450, 19263, 4138, 771),
(63, 'Sptn1', 'Santpoort &shy;Noord (bau)', 'Business as usual', '', 'Santpoort Noord kan ontwikkeld worden als recreatief knooppunt, een Buitenpoort. Het station is hier heel geschikt voor dankzij haar directe ligging aan de Kennemerduinen. Er zijn al wat wandelroutes aanwezig, maar de recreatieve potentie kan nog veel verder uitgebreid worden. [n][n]De kansen liggen voor het oprapen: verbeteren van voorzieningen zoals fietsverhuur en horeca of een bezoekerscentrum en het duidelijk aangeven van wandel- en fietsroutes. Ook een aantrekkelijke en duidelijke entree van het station naar de Kennemerduinen is belangrijk. Dit vraagt om een impuls van de openbare ruimte en het aanpakken van de onaantrekkelijke tunnel. [n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Santpoort Noord stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er stoppen geen bussen bij het station. [n][n]De plannen voor een HOV-verbinding van Haarlem naar IJmuiden strand door de dorpskern van Santpoort Noord zullen de positie van het station niet verbeteren. De HOV-halte ligt straks centraal in het dorp, en er zal minimaal 6x  per uur een snelle bus stoppen. Dit maakt de hoogfrequente bus tot een zeer aantrekkelijk alternatief op de trein.', 'Velsen', 'Zuid-Kennemerland', 19, 245, 3, 74, 73, 2, 5, 18, 211, 2, 0, 1, 0, 1, 182, 47, 14125, 300, 565, 12),
(64, 'Sptz1', 'Santpoort &shy;Zuid (bau)', 'Business as usual', '', 'Santpoort Zuid kan ontwikkeld worden als recreatief knooppunt, hoewel de positie van Santpoort Noord, direct aan de Kennemerduinen, hier wellicht meer kansen voor biedt.[n][n]De visie van de gemeente Velsen is dat de dorpen met de stations ook dorps moeten blijven. Er kan wel wat verdichting van wonen rondom de stations plaatsvinden. Bij hogere dichtheden zal het parkeren echter een probleem gaan worden.', 'Op station Santpoort Zuid stopt 2x per uur een sprinter naar Uitgeest en naar Amsterdam via Haarlem. Er mist een busverbinding naar het station.', 'Velsen, Bloemendaal en Haarlem', 'Zuid-Kennemerland', 19, 120, 25, 11, 143, 0, 19, 19, 174, 17, 0, 6, 0, 2, 3537, 411, 21763, 4975, 871, 199);
INSERT INTO `station` (`id`, `code`, `name`, `variant`, `description_facts`, `description_background`, `description_future`, `town`, `region`, `POVN`, `PWN`, `IWD`, `MNG`, `area_cultivated_home`, `area_cultivated_work`, `area_cultivated_mixed`, `area_undeveloped_urban`, `area_undeveloped_rural`, `transform_area_cultivated_home`, `transform_area_cultivated_work`, `transform_area_cultivated_mixed`, `transform_area_undeveloped_urban`, `transform_area_undeveloped_rural`, `count_home_total`, `count_home_transform`, `count_work_total`, `count_work_transform`, `count_worker_total`, `count_worker_transform`) VALUES
(65, 'Utg1', 'Uitgeest (bau)', 'Business as usual', '', 'Er is recentelijk een nieuw stationsgebouw met P+R voorziening aangelegd en daarmee ziet de gemeente het knooppunt nu als af. De parkeerdruk wordt als een last gezien, maar er is gebrek aan ruimte en geld om het parkeren uit te breiden.[n][n]In de structuurvisie Uitgeest 2020 is de belangrijkste ambitie het realiseren van 500 woningen. Daarmee zal Uitgeest groeien naar 14.000 inwoners, wat het nodig heeft om zelfstandig te blijven. Uitgeest wil om die reden ook de groene buffer handhaven richting Heemskerk. De gemeente heeft inbreidingslocaties en een uitleggebied aan de noordzijde van Uitgeest op het oog. Het stationsgebied speelt hierin geen rol.[n][n]Er was in het verleden sprake van een Rode Kruis ziekenhuis dat nabij het station gerealiseerd zou kunnen worden.Voorlopig komt dat er niet, maar de gemeente staat positief tegenover een dergelijke ontwikkeling.', 'Op station Uitgeest stoppen Intercity’s naar Haarlem en Hoorn, en Sprinters naar Amsterdam en Rotterdam. Er kan worden overgestapt op 2 buslijnen.[n][n]Uitgeest is een succesvolle P+R locatie, goed gelegen bij de splitsing van 2 spoorlijnen en nabij de snelweg. De frequentieverhoging op de Zaancorridor in het kader van PHS biedt kansen voor station Uitgeest. De nu al goede bereikbaarheid van dit station zal alleen nog maar verder toenemen.\r\n', 'Uitgeest', 'Zuid-Kennemerland', 90, 333, 25, 12, 137, 2, 1, 59, 253, 3, 0, 0, 0, 3, 4418, 0, 30950, 0, 1238, 0),
(66, 'Zvt1', 'Zandvoort &shy;aan Zee (bau)', 'Business as usual', '', 'Zandvoort is de enige badplaats in Nederland met een station zo dicht bij het strand. Er zijn diverse plannen gemaakt om, door vernieuwing van de openbare ruimte en het toevoegen van aansprekend programma, de allure van Zandvoort te verbeteren. [n][n]Het belangrijkste is dat het stationsgebied van Zandvoort wordt gekoppeld aan de ontwikkellocatie langs de kust (entree Zandvoort). In dit gebied zijn onder andere horeca, retail en een hotel gepland. Het entreegebied van het station naar het strand zal sterk verbeterd worden zodat Zandvoort dé badplaats van de Metropoolregio Amsterdam kan worden. Tegelijkertijd zal de openbare ruimte ook een facelift moeten krijgen. De boulevard, die de twee belangrijkste ontwikkellocaties verbindt, zal vernieuwd worden. [n][n]De ambitie van de gemeente is om meer jaarrond programma in Zandvoort te krijgen zoals bijvoorbeeld een theater. Daarnaast is er in Zandvoort veel meer te vinden dan alleen de zee. Er is een oude dorpskern en het wordt omgeven door twee grote natuurgebieden, die vanaf het station beter ontsloten zouden moeten worden. ', 'Op station Zandvoort aan Zee stoppen Sprinters naar Haarlem en Amsterdam. Er kan worden overgestapt op 1 buslijn. Het busstation van Zandvoort, waar meer bussen stoppen, ligt op ongeveer 7 minuten lopen van het treinstation. [n][n]Er ligt een R-net concept voor het upgraden van bus 80 (Zandvoort-Adam) naar een HOV-verbinding. Maar bus 75 (HOV-Velsen) zal nu eerst worden ontwikkeld. ', 'Zandvoort', 'Zuid-Kennemerland', 28, 70, 43, 23, 160, 4, 8, 22, 259, 7, 0, 2, 1, 1, 6822, 327, 89400, 14738, 3576, 590);
