INSERT INTO `stationtypes` (`id`, `name`, `description`, `image`, `POVN`, `PWN`, `IWD`, `MNG`) VALUES
(1, 'Centrumdorp', 'Het Centrumdorp is een dorpscentrum met een treinstation en weinig tot geen bestemmingen in de directe omgeving. Er is menging aanwezig van wonen, kleinschalige bedrijvigheid en dagelijkse voorzieningen, maar het heeft de functie van herkomstlocatie in het netwerk. Wanneer het station direct grenst aan een regionaal recreatiegebied/landschap biedt dit kansen. Als het landschap rond het station voor stadsbewoners toegankelijk wordt gemaakt kunnen deze plekken als recreatieve bestemming een bijdrage leveren aan het netwerk.\r\nRuimte                                                                                                                                        Multifunctioneel op dorpse schaal. Wonen in dorpse en landelijke dichtheden. Mix van dagelijkse voorzieningen en horeca. Kleinschalige, lokaal georiënteerde bedrijvigheid. \r\nMobiliteit                                                                                                                                                                          Bereikbaar per openbaar vervoer door middel van sprinters en het onderliggend openbaar vervoersnet (streekbus, buurtbus). De bereikbaarheid per auto is niet bijzonder goed. Het fietsnetwerk en de fietsvoorzieningen zijn daarentegen uitstekend, zodat het station ook voor mensen die er wat verder vandaan wonen goed bereikbaar is. \r\n\r\n', '/SprintStad/images/station_types/centrumdorp.png', 30, 140, 30, 40),
(2, 'OV Kwartier', 'Het OV Kwartier is een herkomststation met weinig tot geen bestemmingen in de directe omgeving.  Het zijn de stations die de kleinere kernen en stadsuitbreidingen met vrij lage dichtheden bedienen. Naast de nabijheid van het station en de betrekkelijke rust is de nabijheid van het landschap vaak een grote schat. Wanneer het station direct grenst aan een regionaal recreatiegebied/landschap biedt dit kansen voor het stationsgebied als recreatieve bestemming.\r\nRuimte                                                                                                                                                                Nadruk op wonen: naoorlogse stadsuitbreidingen met lage dichtheid en voornamelijk grondgebonden woningen in een groene setting. De menging van wonen, werken en voorzieningen is laag. Lokale voorzieningen zoals een zorgcentrum, kinderopvang of supermarkt zijn bij voorkeur geclusterd rondom het station. \r\nMobiliteit                                                                                                                                               Bereikbaar per openbaar vervoer (sprinterstations) en aangesloten op onderliggend openbaar vervoer (streekbussen). De bereikbaarheid per auto is niet bijzonder goed. Het fietsnetwerk en de fietsvoorzieningen zijn daarentegen uitstekend, zodat het station ook voor mensen die er wat verder vandaan wonen goed bereikbaar is. ', '/SprintStad/images/station_types/ovkwartier.png', 60, 140, 50, 10),
(3, 'Buitenstad', 'De Buitenstad is een station in het centrum van een kleine stad of kleinere stedelijke kern. De bereikbaarheid over de weg is minder goed. De Buitenstad is daarom een herkomststation: bezoekers zijn bewoners zelf en enkele fiets- en wandeltoeristen. De al aanwezige lokale voorzieningen in de omgeving en de goede aansluiting op het openbaar vervoersnet zorgen ervoor dat de locaties rond deze stations zich in wat hogere dichtheden kunnen ontwikkelen zonder direct veel automobiliteit te creëren. \r\nRuimte                                                                                                                                                                      Multifunctioneel. Wonen in vrij lage tot gemiddelde dichtheid. Mix van detailhandel en horeca. Werkgelegenheid is voornamelijk in de vorm van kleinschalige, lokaal georiënteerde bedrijvigheid. \r\nMobiliteit                                                                                                                                          Bereikbaar per openbaar vervoer (sprinter stations) maar minder goed bereikbaar per auto. Fietsbereikbaarheid en de aansluiting op onderliggend openbaar vervoer is daarom belangrijk.', '/SprintStad/images/station_types/buitenstad.png', 90, 140, 70, 60),
(4, 'Hubdorp', 'Het Hubdorp is een dorpscentrum met goede multimodale bereikbaarheid. Dit biedt kansen voor werkgelegenheid en regionale of toeristische voorzieningen. Wanneer het station direct grenst aan een regionaal recreatiegebied/landschap biedt dit extra kansen voor het stationsgebied als recreatieve bestemming.\r\nRuimte                                                                                                                                                Multifunctioneel op dorpse schaal. Wonen in lage, dorpse en groene dichtheden. Menging van wonen, lokaal georiënteerde bedrijvigheid, dagelijkse voorzieningen en horeca. Kansen voor lokaal en regionaal georiënteerde kantoren en instellingen en regionale voorzieningen zoals onderwijs en zorg.\r\nMobiliteit                                                                                                                                                     Goede bereikbaarheid per openbaar vervoer en auto: sprinter station, dichtbij een snelwegafslag en met voldoende parkeergelegenheid. Ontsloten door onderliggend openbaar vervoer (bus). Zeer goed fietsnetwerk met voldoende stallingscapaciteit en andere fietsvoorzieningen.', '/SprintStad/images/station_types/hubdorp.png', 30, 300, 30, 50),
(5, 'Poortkwartier', 'Het Poortkwartier is een station die goed per openbaar vervoer én auto te bereiken is en die de kleinere kernen of stadsuitbreidingen met vrij lage dichtheden bedient. De multimodale bereikbaarheid van deze plekken biedt kansen voor werkgelegenheid en regionale of toeristische voorzieningen. Wanneer het station direct grenst aan een regionaal recreatiegebied/landschap biedt dit extra kansen voor het stationsgebied als recreatieve bestemming.\r\nRuimte                                                                                                                                                           Nadruk op wonen: naoorlogse stadsuitbreidingen met vrij lage dichtheden en voornamelijk grondgebonden woningen in een groene setting. Kansen voor lokaal en regionaal georiënteerde kantoren en instellingen en regionale voorzieningen zoals onderwijs en zorg.\r\nMobiliteit                                                                                                                                                               Goede bereikbaarheid per openbaar vervoer en auto: sprinter station, dichtbij een snelwegafslag en met voldoende parkeergelegenheid. Ontsloten door onderliggend openbaar vervoer (bus). Zeer goed fietsnetwerk met voldoende stallingscapaciteit en andere fietsvoorzieningen.', '/SprintStad/images/station_types/poortkwartier.png', 60, 300, 50, 20),
(6, 'Moderne Stad', 'De Moderne Stad is een stadsuitbreiding met een vrij hoge woningdichtheid die goed per openbaar vervoer en auto te bereiken is. De dichtheid biedt draagvlak voor nieuwe voorzieningen en de ontwikkeling van aanvullend openbaar vervoer. De multimodale bereikbaarheid biedt kansen voor werkgelegenheid. De ontwikkeling in deze gebieden bestaat vaak uit herstructurering.\r\nRuimte                                                                                                                                                                             Nadruk op wonen: vooroorlogse en naoorlogse compacte stadsuitbreidingen met stedelijke dichtheden. Voorzieningen zijn geclusterd in wijkwinkelcentra of hoofdstraten. Kansen voor lokaal en regionaal georiënteerde kantoren en instellingen en regionale voorzieningen zoals onderwijs en zorg.\r\nMobiliteit                                                                                                                                                     Goede bereikbaarheid per openbaar vervoer en auto: sprinter station, dichtbij een snelwegafslag en met voldoende parkeergelegenheid. Goed ontsloten door onderliggend openbaar vervoer (bussen, trams, metro). Goed fietsnetwerk met voldoende stallingscapaciteit en andere fietsvoorzieningen.', '/SprintStad/images/station_types/modernestad.png', 120, 300, 90, 30),
(7, 'Regionaal Centrum', 'Het Regionaal Centrum is een stedelijk knooppunt dat goed multimodaal bereikbaar is. De multimodale bereikbaarheid biedt kansen voor lokaal en regionaal georiënteerde kantoren en regionale voorzieningen. Menging van wonen, werken en voorzieningen is al aanwezig, de kans ligt in het verder mengen en verdichten van woon- en werkfuncties.\r\nRuimte                                                                                                                                                      Hoogwaardig gemengd stedelijk gebied met een moderne, soms ook historische uitstraling. Wonen in (klein)stedelijke dichtheden. Veel werkgelegenheid, onder andere in lokaal en regionaal georiënteerde kantoren en instellingen. Mix van detailhandel, horeca en recreatieve voorzieningen. \r\nMobiliteit                                                                                                                                                         Goede bereikbaarheid per openbaar vervoer en auto: sprinter station, dichtbij een snelwegafslag en voldoende parkeergelegenheid aanwezig. Goed tot zeer goed ontsloten door onderliggend openbaar vervoer (bussen, trams, metro). Goed bereikbaar per fiets.', '/SprintStad/images/station_types/regionaalcentrum.png', 120, 300, 90, 70),
(8, 'Metropolitaan Centrum', 'Het Metropolitaan Centrum is een knooppunt bij een middelgrote tot grote stad dat op schaal van de Randstad zeer goed multimodaal bereikbaar is, dus met zowel het openbaar vervoer als de auto. Deze gebieden zijn door hun uitzonderlijke bereikbaarheid zeer geschikt voor werkgelegenheid en bovenregionale voorzieningen. Pas als ook woonfuncties aan deze plekken wordt toegevoegd kunnen zij daadwerkelijk als stedelijke centra gaan functioneren. Infrastructurele barrières en hinderzones maken het toevoegen van woningen in deze gebieden soms lastig.\r\nRuimte                                                                                                                                                Hoogwaardig gemengd stedelijk gebied met een moderne uitstraling. Zeer veel werkgelegenheid, vooral in regionale hoofdkantoren en regionale voorzieningen. Mix van detailhandel, horeca en leisure. Menging met wonen in stedelijke dichtheden.\r\nMobiliteit                                                                                                                                             Uitstekende bereikbaarheid per openbaar vervoer en auto: intercity station, dichtbij een snelwegafslag en snelwegknooppunt en voldoende parkeergelegenheid aanwezig. Zeer goed ontsloten door onderliggend openbaar vervoer. Goed bereikbaar per fiets.', '/SprintStad/images/station_types/metropolitaancentrum.png', 400, 425, 160, 70),
(9, 'Binnenstad', 'De Binnenstad is een stationsomgeving in het centrum van een middelgrote tot grote stad. Het is een multifunctionele locatie met veel mensen die er wonen en werken en een variatie aan voorzieningen. In de Binnenstad komen veel verschillende types bezoekers van recreanten en winkelend publiek tot bewoners en werknemers.\r\nRuimte                                                                                                                                                            Hoogwaardige uitstraling met een mix van historische en moderne gebouwen. Kwalitatief wonen in stedelijke dichtheden. Hoogwaardig voorzieningenniveau met cultuur, winkels, en horeca. Werkgelegenheid vooral in het middensegment kantoren en de kleinschalige en middelgrote dienstverlening of in instellingen met een lokaal en regionaal verzorgingsgebied bijvoorbeeld onderwijsinstellingen.\r\nMobiliteit                                                                                                                                                          Uitstekende bereikbaarheid per trein (intercity en sprinter) en zeer goed ontsloten door het onderliggend openbaar vervoer (bussen, trams). Omdat deze stations in het centrum van de stad liggen, is de bereikbaarheid over de weg minder goed. Vaak zijn er onvoldoende parkeerplaatsen en is er een streng parkeerbeleid. Naast het openbaar vervoer vooral gericht op de voetganger en de fietser.\r\n', '/SprintStad/images/station_types/binnenstad.png', 350, 140, 140, 80),
(10, 'Grootstad', 'De Grootstad is een station in het centrum van Amsterdam, Rotterdam, Utrecht of Den Haag. De omgeving is multifunctioneel met veel mensen die er wonen of werken en een grote variatie aan voorzieningen. Het stationsgebied trekt een enorme diversiteit aan bezoekers (toeristen, dagjesmensen, studenten, werknemers) en is geschikt om het (inter)nationale brandpunt voor entertainment en cultuur te worden. Het belang van de bereikbaarheid met het openbaar vervoer zal dan alleen maar toenemen.\r\nRuimte                                                                                                                                                 Hoogwaardige uitstraling met een mix van historische en moderne gebouwen. Kwalitatief wonen in hoge stedelijke dichtheden. Zeer hoogwaardig voorzieningenniveau met cultuur, winkels en horeca. Veel werkgelegenheid, vooral in het middensegment kantoren en de kleinschalige en middelgrote dienstverlening.\r\nMobiliteit                                                                                                                                              Uitstekende (inter)nationale bereikbaarheid per trein (hsl, intercity en sprinter) en zeer goed ontsloten door het onderliggend openbaar vervoer (metro’s, bussen, trams). Omdat deze stations in de centra van de grote steden liggen, is de bereikbaarheid over de weg minder goed. Vaak zijn er onvoldoende parkeerplaatsen. Naast het openbaar vervoer vooral gericht op de voetganger en de fietser.', '/SprintStad/images/station_types/grootstad.png', 800, 140, 225, 80),
(11, 'Wereldstad', 'De Wereldstad is een station waarbij de omgeving van belang is voor de internationale concurrentiepositie van de Nederlandse Deltametropool. Het zijn de toplocaties met (inter)nationale hoofdkantoren, hoge dichtheid wonen en ene grote variatie aan voorzieningen. De internationale aantrekkingskracht van deze plekken kan zich alleen ontwikkelen als hun bereikbaarheid per openbaar vervoer, auto en fiets uitstekend is. \r\nRuimte                                                                                                                                                 Hoogwaardig gemengd stedelijk gebied met een hoge kwaliteit openbare ruimte, beeldbepalende kantoorgebouwen en landmarks. Maximaal multifunctioneel. Zeer hoge dichtheid van werkgelegenheid met topsegment kantoren. Kwalitatief wonen in hoge dichtheden. Groot voorzieningenaanbod: hotels, vergader- en congrescentra, winkels, cultuur, horeca. \r\nMobiliteit                                                                                                                                          Uitstekende (inter)nationale bereikbaarheid per openbaar vervoer en auto: hsl station, goed verbonden met vliegveld, snelwegafslag nabij en voldoende (ondergrondse) parkeergelegenheid. Zeer goed ontsloten door onderliggend openbaar vervoer. Goed bereikbaar per fiets.', '/SprintStad/images/station_types/wereldstad.png', 800, 425, 250, 70);
