INSERT INTO `teaminstance` (`id`, `game_id`, `team_id`, `value_description`) VALUES
(34, 12, 0, 'PHS uitvoeren:\n\n2 extra intercity''s in 2014 tot Alkmaar\n\n2 extra sprinters in 2022 tot Alkmaar'),
