(46, 14, 0, 'PHS uitvoeren:\n\nIn 2014 2 extra IC''s tussen Amsterdam CS en Alkmaar\n\nIn 2022 2 extra Sprinters tussen Amsterdam CS en Uitgeest'),
(47, 14, 1, NULL),
(48, 14, 10, NULL),
(49, 15, 0, 'De trein is in staat ruimtelijke dynamiek te faciliteren. Frequentieverhoging genereert ook weer reizigers. Dit gebied is gericht op Amsterdam. Met een betere bereikbaarheid per trein wordt het aantrekkelijker om voor het openbaar vervoer te kiezen.'),
(50, 15, 1, NULL),
(51, 15, 4, 'De lokale uitdaging is om in Ã©Ã©n samenhangend stedelijk weefsel een nieuwe monofunctionele woonwijk (Broekhorn, Bouwfonds MAB), het Stationsgebied met zakelijke (overheids) dienstverlening, ziekenhuis en zorg, onderwijs en wonen en het Stadshart met CORIO''s overdekte winkelcentrum (50.000m2) logisch met elkaar te verbinden.\n\nOnderscheidend vermogen langs de Zaancorridor is cruciaal voor Heerhugowaard. Heerhugowaard is de grote onbekende in NHN, terwijl de komst van het nieuwe ziekenhuis (een van de grote RTIC''s van Nederland) en de aanwezigheid van CORIO''s overdekte winkelcentrum (50.000m2, ter vergelijk: Hoog Catharijne is 62.000 m2) sterke bovenregionale trekkers zijn...'),
(52, 15, 5, 'mogelijkheden die er zijn benutten. Realiseren van divers programma. Wel afstemming met buurgemeenten om te voorkomen dat geen van de plannen door tegenvallende vraag vanuit de markt, van de grond komt.'),
(53, 15, 6, 'Heiloo is bij uitstek een woongemeente. Ambitie is om een maximaal aantal ov-reizigers te genereren ten behoeve van woon-werk relaties. Op die manier krijgt de gemeente een unieke positie op de woningmarkt in een hoog segment.'),
(54, 15, 7, 'ligging van Castricum als poort naar het duingebied maximaal zichtbaar maken en proberen uit te nutten door intensivering en voorzieningen aan te bieden'),
(55, 15, 8, 'Samenhang met de omgeving: Eventuele ruimtelijke ontwikkeling passend bij de kleinstedelijke omgeving die Uitgeest is.\n\nOptimalisering OV-gebruik van het station: voortbouwen op de uitstekende P+R functie. Waar mogelijk beter benutten of uitbreiden.'),
(56, 15, 9, 'Realisering: aan elkaar smeden oost en west kant station en aantrekkelijker maken centrum (Zaandam), uitbreiding woonlocatie (K-A)\n\nDiversiteit: Zaandam als centrum functie, Krommenie Assendelft als 2e knooppunt, andere stations lagere ro ambitie, aantrekkelijk station, Koog Zaandijk (zaanse schans) ook toerisme\n\n'),
(57, 15, 10, 'Voor Amsterdam Centraal is voor de Noordkant de realisering van groot belang. Voor het station is het verder erg belangrijk dat het OV gebruik wordt geoptimaliseerd in verhouding tot de N-Zlijn en station Zuid. Voor Sloterdijk geldt ook nog dat de diversiteit van de stationsomgeving van groot belang is.'),
