(241, 74, 8, 'Groei aantal inwoners door de bouw van 1000 woningen rond OV-knooppunt.\n\nGroei aantal inwoners omhoog bijgesteld naar 1500 woningen gezien de realisatie van 800 woningen Wonen Stedelijk in de eerste 3 termijnen.\n\nRegionale vraag naar Wonen Groen deels opvangen in Uitgeest.\n\n'),
(242, 74, 13, 'uitstappers gewenst door vestiging voorziening regionaal opleidingscentrum (direct bij station en roze gebeid Bevrwijk), groene voorziening 4 ha (park Assumburg)\nverbeterde bereikbaarheid van het station voor en natransport\n 6 ha woningbouw kleinstedelijk/dorps'),
(243, 74, 14, 'Onze ambitie is om het Stationsgebied als onderdeel van de stad leefbaar, werkbaar, vitaal te houden en te versterken. De grijze plekken en missing links verbeteren op het gebied van wonen, werken, bereikbaarheid en recreatie:\n- Frequente en betrouwbare verbindingen met enerzijds Haarlem, Amsterdam, Leiden en Alkmaar en anderzijds met Beverwijk, Heemskerk, Velsen-Noord (Tata) en Wijk aan Zee.\n- Versterken regionale centrumfunctie noordelijke IJmond.\n- Versterken bedrijvigheid rond het station, Breestraat (centrum), meubelboulevard en kop van de haven.\n- Versterken stedelijk (en kleinstedelijk) woonmilieu.'),
